INSERT INTO `cadrelatorios` VALUES (1,'ServIP','select \r\n  cis.chave as CI, \r\n  tipocis.tipo,\r\n  statuscis.status,\r\n  left(cis.descricao,30) as Descricao,\r\n  sites.nome as Site, \r\n  atributos.valor as IP \r\nfrom cis, \r\n  atributos,\r\n  sites,\r\n  tipocis,\r\n  statuscis\r\n\r\nwhere \r\n   (atributos.dicdado_id = 6 or atributos.dicdado_id=10) and \r\n    atributos.ci_id = cis.id and \r\n    cis.site_id = sites.id and \r\n    cis.tipoci_id = tipocis.id and\r\n    cis.statusci_id = statuscis.id\r\n\r\n\r\norder by atributos.valor;\r\n\r\n\r\n','2013-04-18 01:03:13','2014-09-20 16:18:09','Servidores - Tipo - Status - Site',NULL,NULL,'2014-09-20',1),(2,'AlertasCWBGestor','select  \r\n  sites.nome as Site,\r\n  categories.name as \"Cliente\",\r\n  DATE_FORMAT(tasks.created_at, \'%d-%m\')  as \"Criando em \",\r\n  status as Status,\r\n\r\n  tipotask as tipo,\r\n  fornecedores.nome as Fornecedor, \r\n  concat(tasks.nome,\"-\",tasks.description) as Alerta \r\nfrom \r\n   tasks,\r\n   fornecedores,\r\n   sites,\r\n   categories\r\nwhere site_id in (1,4,7) and \r\n   publica and \r\n   fornecedores.id = tasks.fornecedor_id and \r\n   categories.id = tasks.category_id and\r\n   sites.id = tasks.site_id and \r\n   tasks.ativo=1','2013-04-19 13:55:28','2014-09-09 20:44:16','Alertas de Curitiba',NULL,NULL,'2014-09-09',1),(3,'TodosLinks','Select \r\n contratos.codcontrato as Codigo ,\r\n left(fornecedores.nome,20) as Fornecedor, \r\n FORMAT(contratos.valormensal,2) as \"Valor Mensal\" \r\nfrom \r\n contratos, \r\n fornecedores \r\nwhere \r\n tipocontrato_id=3 and \r\n contratos.fornecedor_id = fornecedores.id\r\norder by \r\n fornecedor\r\n','2013-05-20 17:26:32','2014-04-10 17:40:15','Links BRQ com operadora e custo mensal - Visao Fornecedores',NULL,NULL,NULL,NULL),(4,'EmMudanca','select cis.chave as CI, statuscis.status as Status, tipocis.tipo,cis.descricao as Descricao from cis, statuscis,tipocis where \r\ncis.statusci_id in(3,4,6) and cis.tipoci_id = tipocis.id \r\nand cis.statusci_id = statuscis.id','2013-06-10 13:29:12','2014-05-30 14:25:38','CIs com status de Em Mudanca',NULL,NULL,NULL,NULL),(5,'ServidoresXServicos','select\r\n        cis.chave as CI,\r\n        left(cis.descricao ,30) as Descricao,\r\n        MAX(IF(atributos.dicdado_id = 103, atributos.valor, NULL)) as \"Terceirizar?\" ,\r\n        MAX(IF(atributos.dicdado_id = 78, atributos.valor, NULL)) as Tipo ,\r\n        MAX(IF(atributos.dicdado_id = 9, atributos.valor, NULL)) as Servicos ,\r\n        MAX(IF(atributos.dicdado_id = 6 , atributos.valor, NULL)) as IP\r\n  \r\n    from\r\n        cis,\r\n        atributos,\r\n        sites,\r\n        tipocis\r\n     where\r\n        cis.tipoci_id=32 and\r\n        atributos.ci_id = cis.id and\r\n        cis.site_id = sites.id and\r\n        cis.tipoci_id = tipocis.id\r\n      group by\r\n        cis.chave\r\n      order by\r\n        cis.chave;','2013-06-14 14:24:29','2013-12-30 19:10:14','Servidores e servicos que rodam (core, desenv, etc)',NULL,NULL,NULL,NULL),(6,'Links','select\r\n        cis.id as ID,\r\n        cis.chave as CI,\r\n        cis.descricao as Descricao,\r\n        MAX(IF(atributos.dicdado_id = 1, atributos.valor, NULL)) as Banda,\r\n        MAX(IF(atributos.dicdado_id = 3, atributos.valor, NULL)) as Designacao,\r\n        MAX(IF(atributos.dicdado_id = 2, atributos.valor, NULL)) as \"Endereco Ponta A\",\r\n        MAX(IF(atributos.dicdado_id = 114, atributos.valor, NULL)) as \"Endereco Ponta B\"       \r\n    from\r\n        cis,\r\n        atributos,\r\n        \r\n        tipocis\r\n     where\r\n        cis.tipoci_id=14 and\r\n        atributos.ci_id = cis.id and\r\n        cis.statusci_id =1 and\r\n        cis.tipoci_id = tipocis.id\r\n \r\n       \r\n      group by\r\n        cis.chave\r\n      order by\r\n        Designacao;\r\n\r\n# cis.descricao like \'%level3%\' and','2013-06-19 18:33:10','2014-07-10 17:27:18','Links ATIVOS com designacao',NULL,NULL,NULL,NULL),(7,'Contratos','select \"Codigo Contrato,Descricao,Data Inicio,Data Fim,Data Renovacao, Projeto CC TI, Projeto CC Area, Classificacao, Nome Fornecedor, Tipo Contrato\" union \r\nselect convert(concat_ws(\',\',c.codcontrato, \r\nifnull( c.descricao,\'\'),  \r\nifnull( c.datainicio,\'\'),  \r\nifnull( c.datafim,\'\'),  \r\nifnull( c.datarenovacao,\'\'), \r\nifnull( c.projetoCCTI,\'\'), \r\nifnull( c.projetoCCArea,\'\'),  \r\nifnull( c.classificacao,\'\') ,\r\nifnull( f.nome,\'\'),\r\nifnull( tc.descricao, \'\')\r\n) using utf8)\r\nfrom contratos c, fornecedores f,tipocontratos tc where c.tipocontrato_id = tc.id and c.fornecedor_id = f.id;','2013-07-16 16:10:51','2014-09-09 20:45:08','relação de todos os contratos',NULL,NULL,'2014-09-09',1),(9,'Links cristiano','Select \r\n  cis.descricao, \r\n  sites.nome, \r\n    MAX(IF(atributos.dicdado_id = 1, atributos.valor, NULL)) as Banda\r\n\r\nfrom cis , sites, atributos\r\nwhere  \r\n \r\n owner like \'%cristiano%\' and\r\n cis.site_id = sites.id and\r\n atributos.ci_id = cis.id and\r\n cis.tipoci_id=14\r\n\r\n\r\n\r\n','2013-08-21 19:27:04','2013-08-21 19:45:51','',NULL,NULL,NULL,NULL),(11,'Contratos de lInks','Select \r\n   contratos.codcontrato as Contrato,\r\n   fornecedores.nome as Fornecedor, \r\n   cast(contratos.valormensal as char) as valor\r\nfrom \r\n   contratos, \r\n   fornecedores \r\nwhere \r\n   tipocontrato_id=3 and \r\n   contratos.fornecedor_id = fornecedores.id\r\n\r\norder by fornecedores.nome;','2013-09-03 15:56:02','2013-09-30 18:02:18','Valor dos links pelos contratos',NULL,NULL,NULL,NULL),(12,'CustoContratos','select \r\n   cast(sum(customensal) as char) as \"Custo Total por CI\",\r\n   cast(sum(contratos.valormensal) as char) as \"Custo total por contrato\", \r\n   fornecedores.nome As Fornecedor \r\nfrom \r\n   cis, \r\n   contratos, \r\n   fornecedores \r\nwhere \r\n   cis.contrato_id = contratos.id and \r\n   contratos.fornecedor_id = fornecedores.id \r\ngroup by \r\n   fornecedores.nome\r\n\r\n\r\nUNION\r\n\r\nselect \r\n   \"=====================\",\r\n   \"=====================\",\r\n   \"=====================\"\r\n\r\nUNION\r\n\r\nselect \r\n   cast(sum(customensal) as char) as CustoTotalCI,\r\n   cast(sum(contratos.valormensal) as char) as CustoTotalContrato, \r\n   \"TOTAL\" As Fornecedor \r\nfrom \r\n   cis, \r\n   contratos, \r\n   fornecedores \r\nwhere \r\n   cis.contrato_id = contratos.id and \r\n   contratos.fornecedor_id = fornecedores.id ','2013-09-06 14:11:16','2013-09-06 14:31:35','Custo total por fornecedor',NULL,NULL,NULL,NULL),(13,'Fornecedores',' select nome, endereco, contatos, anotacoes, enderecos from fornecedores;','2013-10-22 14:17:44','2013-10-22 14:17:44','',NULL,NULL,NULL,NULL),(14,'CIsAlterados','select\r\n        cis.chave as CI,\r\nowner as Email,\r\n        left(cis.descricao ,30) as Descricao,\r\n        DATE_FORMAT(updated_at , \'%d-%M-%y - %T\') as \"Ultima Alteracao\"\r\n    from\r\n        cis\r\n      order by\r\n        updated_at desc;','2013-11-01 21:00:03','2013-11-04 21:08:37','Relatorio dos ultimos CIs alterados',NULL,NULL,NULL,NULL),(15,'ServidoresInativos','select \r\n  cis.chave as CI, \r\n  tipocis.tipo,\r\n  statuscis.status,\r\n  left(cis.descricao,30) as Descricao,\r\n  sites.nome as Site, \r\n  atributos.valor as IP \r\nfrom cis, \r\n  atributos,\r\n  sites,\r\n  tipocis,\r\n  statuscis\r\n\r\nwhere \r\n   (atributos.dicdado_id = 6 or atributos.dicdado_id=10) and \r\n    atributos.ci_id = cis.id and \r\n    cis.site_id = sites.id and \r\n    cis.tipoci_id = tipocis.id and\r\n    cis.statusci_id = statuscis.id and\r\n    cis.statusci_id <> 1\r\n\r\n\r\norder by atributos.valor;','2013-11-04 12:14:05','2013-11-04 12:14:05','Servidores nao ativos',NULL,NULL,NULL,NULL),(16,'OwnerErrado','select \r\nchave as CI,\r\nOwner \r\nfrom cis \r\nwhere owner like \'%@brq%\' or owner is null or owner=\'\'\r\norder by owner desc','2013-11-04 13:58:39','2013-11-04 14:01:45','Relacao de CI com Owner incorreto',NULL,NULL,NULL,NULL),(18,'CI com IP duplicado','select \r\n  cast(ci_id as char) as CI\r\nfrom \r\n  atributos \r\nwhere valor in (\r\n            select \r\n                valor \r\n            from \r\n                atributos \r\n            where  (atributos.dicdado_id = 6 or atributos.dicdado_id=10) and valor <> \"\" and valor is not null group by valor having count(*) > 1) ','2013-11-04 15:15:24','2013-11-04 15:50:57','ATENCAO: relatorio lento. Nao execute sempre',NULL,NULL,NULL,NULL),(19,'ServidoresSisint','select \r\n  cis.chave as CI, \r\n  tipocis.tipo,\r\n  statuscis.status,\r\n  cis.Owner as Owner,\r\n  left(cis.descricao,30) as Descricao,\r\n  sites.nome as Site, \r\n  atributos.valor as IP \r\nfrom cis, \r\n  atributos,\r\n  sites,\r\n  tipocis,\r\n  statuscis\r\n\r\nwhere \r\n   (atributos.dicdado_id = 6 or atributos.dicdado_id=10) and \r\n    atributos.ci_id = cis.id and \r\n    cis.site_id = sites.id and \r\n    cis.tipoci_id = tipocis.id and\r\n    cis.statusci_id = statuscis.id and\r\n    ((cis.owner like \'%wleite%\') or (cis.owner like  \'%pneto%\'))\r\n\r\n\r\norder by atributos.valor;\r\n','2013-11-11 20:08:09','2014-08-15 19:50:04','Servidor Willian leite',NULL,NULL,NULL,NULL),(20,'Atributos Existentes','Select cis.chave as CI, dicdados.nome, atributos.valor from cis, atributos, dicdados\r\nwhere atributos.ci_id = cis.id and\r\natributos.valor <> \'\' and\r\ndicdados.id = atributos.dicdado_id and\r\natributos.dicdado_id = 73\r\n','2013-12-06 13:54:54','2013-12-06 14:08:10','Mostra atributos existentes (preenchidos)',NULL,NULL,NULL,NULL),(21,'UltimosCISCriados','select\r\n        cis.chave as CI,\r\n        tipocis.tipo,\r\n        left(cis.owner,20) as Email,\r\n        left(cis.descricao ,20) as Descricao,\r\n        cast(datediff(now(),cis.created_at) as char) as \"Dias desde a criacao\",\r\n        DATE_FORMAT(cis.created_at , \'%d-%M-%y - %T\') as \"Data Criacao\"\r\n    from\r\n        cis, \r\n        tipocis\r\n    where \r\n       cis.tipoci_id = tipocis.id and\r\n       datediff(now(),cis.created_at) < 60\r\n    order by\r\n       cis.created_at desc;','2013-12-06 14:18:10','2014-03-26 20:30:19','Ultimos CI criados',NULL,NULL,NULL,NULL),(22,'Acertar Owner','select cis.chave as CI, cis.owner ,  cis.notificacao from cis where  cis.owner like \'%,%\' or cis.notificacao like \'%,%\' ;\r\n','2013-12-12 18:49:09','2013-12-12 18:49:09','',NULL,NULL,NULL,NULL),(23,'TodosIPsBRQ','select \r\n  cis.chave as CI, \r\n  tipocis.tipo,\r\n  statuscis.status,\r\n  left(cis.descricao,30) as Descricao,\r\n  sites.nome as Site, \r\n  dicdados.nome as \"Tipo IP\",\r\n  atributos.valor as IP \r\nfrom cis, \r\n  atributos,\r\n  sites,\r\n  tipocis,\r\n  statuscis,\r\n  dicdados\r\n\r\nwhere \r\n   (left(dicdados.nome,2) = \"IP\") and \r\n    dicdados.id = atributos.dicdado_id and\r\n    atributos.ci_id = cis.id and \r\n    cis.site_id = sites.id and \r\n    cis.tipoci_id = tipocis.id and\r\n    cis.statusci_id = statuscis.id\r\n\r\n\r\norder by atributos.valor;\r\n','2013-12-13 14:03:26','2014-09-09 20:42:27','IPs de Rede, switche, servidores',NULL,NULL,NULL,1),(24,'ErroLinkSemMonitoracao','select \r\n  cis.chave as CI, \r\n  tipocis.tipo,\r\n  statuscis.status,\r\n  left(cis.descricao,30) as Descricao,\r\n  sites.nome as Site, \r\n  atributos.valor as Monitoracao\r\nfrom cis, \r\n  atributos,\r\n  sites,\r\n  tipocis,\r\n  statuscis\r\n\r\nwhere \r\n   (atributos.dicdado_id = 8) and \r\n    atributos.ci_id = cis.id and \r\n    cis.site_id = sites.id and \r\n    cis.tipoci_id = tipocis.id and\r\n    cis.statusci_id = statuscis.id\r\n\r\n\r\norder by atributos.valor;\r\n\r\n','2013-12-18 16:03:10','2014-08-01 14:30:13','Links sem Monitoracao',NULL,NULL,NULL,NULL),(25,'SLAAlertasMaisAgressores','(select \r\n	\r\n        cis.chave as CI,\r\n	cast(month(tasks.created_at) as char) as Mes,\r\n        \"2013\" as Ano,\r\n	cast(count(*) as char) as Total\r\nfrom \r\n	tasks, cis\r\nwhere \r\n      cis.id = tasks.ci_id and\r\n      year(tasks.created_at) = 2013 and\r\n      ci_id is not null\r\ngroup by \r\n	ci_id, month(tasks.created_at)\r\n\r\nhaving count(*) > 1\r\n\r\norder by \r\n	count(*) desc)\r\nUNION\r\n(\r\nselect \r\n	\r\n        cis.chave as CI,\r\n	cast(month(tasks.created_at) as char) as Mes,\r\n        \"2014\" as Ano,\r\n	cast(count(*) as char) as Total\r\nfrom \r\n	tasks, cis\r\nwhere \r\n      cis.id = tasks.ci_id and\r\n      year(tasks.created_at) = 2014 and\r\n      ci_id is not null\r\ngroup by \r\n	ci_id, month(tasks.created_at)\r\n\r\nhaving count(*) > 1\r\n\r\norder by \r\n	count(*) desc);\r\n','2013-12-19 15:53:53','2014-01-30 16:37:02','',NULL,NULL,NULL,NULL),(26,'Range de Ramais','select\r\n        cis.chave as CI,\r\n        sites.nome as \"Localidade\",\r\n        MAX(IF(atributos.dicdado_id = 105, atributos.valor, NULL)) as \"Numero Chave\" ,\r\n        MAX(IF(atributos.dicdado_id = 106, atributos.valor, NULL)) as  \"Canais\" ,\r\n        MAX(IF(atributos.dicdado_id = 107, atributos.valor, NULL)) as  \"Faixa de Ramais\" ,\r\n        MAX(IF(atributos.dicdado_id = 108, atributos.valor, NULL)) as  \"Quantidade de Ramais\" ,\r\n        MAX(IF(atributos.dicdado_id = 109, atributos.valor, NULL)) as  \"Designacao\" ,\r\n        MAX(IF(atributos.dicdado_id = 111, atributos.valor, NULL)) as  \"Operadora\" ,\r\n        MAX(IF(atributos.dicdado_id = 110, atributos.valor, NULL)) as  \"Data de Ativacao\" \r\n  \r\n    from\r\n        cis,\r\n        atributos,\r\n        sites,\r\n        tipocis\r\n     where\r\n        cis.tipoci_id=34 and\r\n        atributos.ci_id = cis.id and\r\n        cis.site_id = sites.id and\r\n        cis.tipoci_id = tipocis.id\r\n      group by\r\n        cis.chave\r\n      order by\r\n        cis.chave;','2014-01-15 19:40:51','2014-01-15 20:03:50','',NULL,NULL,NULL,NULL),(27,'ServRMLabore','select \r\n  cis.chave as CI, \r\n  atributos.valor as IP,\r\n  statuscis.status,\r\n  left(cis.descricao,30) as Descricao,\r\n  sites.nome as Site,\r\n  cis.Owner as Usuario\r\n\r\nfrom cis, \r\n  atributos,\r\n  sites,\r\n  tipocis,\r\n  statuscis\r\n\r\nwhere \r\n   (atributos.dicdado_id = 6 or atributos.dicdado_id=10) and \r\n    atributos.ci_id = cis.id and \r\n    cis.site_id = sites.id and \r\n    cis.tipoci_id = tipocis.id and\r\n    cis.statusci_id = statuscis.id and \r\n    cis.descricao like \"%RM Labore%\"\r\n\r\n\r\norder by atributos.valor;\r\n','2014-02-06 19:47:15','2014-02-06 19:55:48','Servidores Citrix do RM Labore',NULL,NULL,NULL,NULL),(29,'EnderecosLocalidadesCNPJ','select\r\n        cis.chave as CI,\r\n        statuscis.status,\r\n        cis.descricao as Descricao,\r\n\r\n        MAX(IF(atributos.dicdado_id = 115, atributos.valor, NULL)) as Endereco,\r\n        MAX(IF(atributos.dicdado_id = 116, atributos.valor, NULL)) as CNPJ\r\n       \r\n    from\r\n        cis,\r\n        atributos,\r\n        statuscis,\r\n        tipocis\r\n     where\r\n        cis.tipoci_id=4 and\r\n        atributos.ci_id = cis.id and\r\n        cis.statusci_id = statuscis.id and\r\n        \r\n        cis.tipoci_id = tipocis.id\r\n       \r\n      group by\r\n        cis.chave\r\n\r\n      order by CI\r\n      ','2014-02-10 20:21:58','2014-05-21 16:03:32','Relacao de localidades com endereco',NULL,NULL,NULL,NULL),(30,'ServidoresSemMonit','select \r\n  cis.chave as CI, \r\n  statuscis.status,\r\n  left(cis.descricao,30) as Descricao,\r\n  DATE_FORMAT(cis.created_at , \'%d-%M-%y - %T\') as \"Data Criacao\",\r\n  sites.nome as Site\r\nfrom cis, \r\n  atributos,\r\n  sites,\r\n  tipocis,\r\n  statuscis\r\n\r\nwhere \r\n   (atributos.dicdado_id = 30) and \r\n    atributos.ci_id = cis.id and \r\n    cis.site_id = sites.id and \r\n    cis.tipoci_id = tipocis.id and\r\n    cis.statusci_id = statuscis.id and\r\n    (atributos.valor = \"\" or atributos.valor is null)\r\n    \r\n\r\n\r\norder by cis.created_at desc;','2014-03-26 20:19:02','2014-03-26 20:22:50','Servidores sem monitoração',NULL,NULL,NULL,NULL),(31,'CISemMonitoracao','select \r\n \r\n  cast(cis.id as char(6)) as \"ID\", \r\n cis.chave as \"CI\", \r\n  tipocis.tipo as \"Tipo CI\",\r\n  statuscis.status,\r\n  left(cis.descricao,30) as Descricao,\r\n  DATE_FORMAT(cis.created_at , \'%d-%M-%y - %T\') as \"Data Criacao\",\r\n  sites.nome as Site\r\nfrom cis, \r\n  atributos,\r\n  sites,\r\n  tipocis,\r\n  statuscis\r\n\r\nwhere \r\n   (atributos.dicdado_id in (30,55,104,133,151,152,153,154,155) ) and \r\n    atributos.ci_id = cis.id and \r\n    cis.site_id = sites.id and \r\n    cis.tipoci_id = tipocis.id and\r\n    cis.statusci_id = statuscis.id and\r\n    (atributos.valor = \"\" or atributos.valor is null)\r\n\r\n union\r\n\r\nSelect \r\n \r\n  cast(cis.id as char(6)) as \"ID\", \r\n   cis.chave as \"CI\", \r\n	  tipocis.tipo as \"Tipo CI\",\r\n	  statuscis.status,\r\n	  left(cis.descricao,30) as Descricao,\r\n	  DATE_FORMAT(cis.created_at , \'%d-%M-%y - %T\') as \"Data Criacao\",\r\n	  sites.nome as Site\r\n        \r\nfrom \r\n       	cis,\r\n        dicdados,\r\n        statuscis,\r\n        tipocis,\r\n        sites\r\n	\r\nwhere \r\n   cis.tipoci_id = dicdados.tipoci_id and\r\n   dicdados.id in (30,55,104,133,151,152,153,154,155) and\r\ncis.site_id = sites.id and \r\n    cis.tipoci_id = tipocis.id and\r\n    cis.statusci_id = statuscis.id and\r\n\r\n   cis.id not in\r\n   (\r\n   select \r\n   	ci_id  \r\n   from \r\n	atributos\r\n   where \r\n        atributos.dicdado_id in (30,55,104,133,151,152,153,154,155) \r\n\r\n);\r\n','2014-03-27 15:57:16','2014-03-27 16:49:37','CIs sem o campo monitoracao preenchido',NULL,NULL,NULL,NULL),(32,'LinksCustosMultas','select\r\n        cis.chave as CI,\r\n        cis.descricao as Descricao,\r\n        fornecedores.nome as Fornecedor,\r\n        cast( cast(cis.CustoMensal as unsigned integer) as char) as CustoMensal ,\r\n        MAX(IF(atributos.dicdado_id = 64, atributos.valor, NULL)) as ValorTotalContrato,\r\n        MAX(IF(atributos.dicdado_id = 57, atributos.valor, NULL)) as TempoContrato,\r\n        MAX(IF(atributos.dicdado_id = 67, atributos.valor, NULL)) as Multa,\r\n        MAX(IF(atributos.dicdado_id = 56, atributos.valor, NULL)) as DataAtivacao,\r\n        MAX(IF(atributos.dicdado_id = 62, atributos.valor, NULL)) as DataRenovacao\r\n       \r\n    from\r\n        cis,\r\n        atributos,\r\n        contratos, \r\n        fornecedores,\r\n        tipocis\r\n     where\r\n        cis.tipoci_id=14 and\r\n        atributos.ci_id = cis.id and\r\n        cis.contrato_id = contratos.id and\r\n        contratos.fornecedor_id = fornecedores.id and\r\n        cis.tipoci_id = tipocis.id\r\n       \r\n      group by\r\n        cis.chave\r\n\r\norder by CI','2014-04-10 17:41:20','2014-04-10 18:22:00','Links e Custos de Multa',NULL,NULL,NULL,NULL),(33,'PlacaDados','select\r\n        cis.chave as CI,\r\n        left(cis.descricao ,30) as Nome,\r\n        cis.Owner as Owner,\r\n        Notificacao as \"Usuario\",\r\n        MAX(IF(atributos.dicdado_id = 172, atributos.valor, NULL)) as \"Operadora\" ,\r\n        MAX(IF(atributos.dicdado_id = 158, atributos.valor, NULL)) as \"Perfil\" ,\r\n        MAX(IF(atributos.dicdado_id = 163, atributos.valor, NULL)) as \"Status\" ,\r\n        MAX(IF(atributos.dicdado_id = 171, atributos.valor, NULL)) as \"Modelo\" ,\r\n        left(MAX(IF(atributos.dicdado_id = 164, atributos.valor, NULL)),30) as \"Observacao\" ,\r\n        sites.nome as \"site\"\r\n  \r\n    from\r\n        cis,\r\n        atributos,\r\n        sites,\r\n        tipocis\r\n     where\r\n        cis.tipoci_id=36 and\r\n        atributos.ci_id = cis.id and\r\n        cis.site_id = sites.id and\r\n        cis.tipoci_id = tipocis.id\r\n      group by\r\n        cis.chave\r\n      order by\r\n        cis.chave;','2014-05-14 22:41:51','2014-05-14 23:09:08','Placa de Dados',NULL,NULL,NULL,NULL),(34,'Cobrancas','select CCdebito as \"Centro de Custos\",ProjetoDebito as \"Projeto\",descricao, cast(cast(cis.CustoMensal*-100 as decimal(10,0) )as char) as Despesa, cast(10 as char) as GrupoGerencial, \"Dados\" as tipo, chave as CI from cis where tipoci_id=36 and CCdebito <> \"\"\r\n\r\nunion\r\n\r\nselect CCCredito as \"Centro de Custos\",ProjetoCredito as \"Projeto\",descricao,cast(cast(cis.CustoMensal*100 as decimal(10,0) )as char) as Despesa, cast(10 as char) as GrupoGerencial, \"Dados\" as tipo, chave as CI  from cis where tipoci_id=36 and CCdebito <> \"\"\r\n\r\nunion\r\n\r\nselect CCdebito as \"Centro de Custos\",ProjetoDebito as \"Projeto\",descricao, \"-1\" as Despesa, cast(49 as char) as GrupoGerencial, \"Celular\" as tipo, chave  as CI from cis where tipoci_id=37 and CCdebito <> \"\"\r\n\r\nunion\r\n\r\nselect CCCredito as \"Centro de Custos\",ProjetoCredito as \"Projeto\",descricao,\"1\" as Despesa, cast(49 as char) as GrupoGerencial, \"Celular\" as tipo , chave  as CI from cis where tipoci_id=37 and CCdebito <> \"\"\r\n\r\nunion\r\n\r\nselect CCdebito as \"Centro de Custos\",ProjetoDebito as \"Projeto\",descricao, cast(cast(cis.CustoMensal*-100 as decimal(10,0) )as char) as Despesa, cast(10 as char) as GrupoGerencial, \"Link\" as tipo, chave  as CI from cis where tipoci_id=14 and CCdebito <> \"\" and CCDebito <> \"C3731\"\r\n\r\nunion\r\n\r\nselect CCCredito as \"Centro de Custos\",ProjetoCredito as \"Projeto\",descricao,cast(cast(cis.CustoMensal*100 as decimal(10,0) )as char) as Despesa, cast(10 as char) as GrupoGerencial, \"Link\" as tipo, chave  as CI from cis where tipoci_id=14 and CCdebito <> \"\" and CCDebito <> \"C3731\"\r\n\r\nunion\r\n\r\nselect CCdebito as \"Centro de Custos\",ProjetoDebito as \"Projeto\",descricao, cast(cast(cis.CustoMensal*-100 as decimal(10,0) )as char) as Despesa, cast(10 as char) as GrupoGerencial, \"Cobranca Gerencial\" as tipo, chave  as CI from cis where tipoci_id=41 and CCdebito <> \"\" and CCDebito <> \"C3731\"\r\n\r\nunion\r\n\r\nselect CCCredito as \"Centro de Custos\",ProjetoCredito as \"Projeto\",descricao,cast(cast(cis.CustoMensal*100 as decimal(10,0) )as char) as Despesa, cast(10 as char) as GrupoGerencial, \"Cobranca Gerencial\" as tipo, chave  as CI from cis where tipoci_id=41 and CCdebito <> \"\" and CCDebito <> \"C3731\"\r\n\r\n','2014-05-15 13:04:54','2014-05-28 18:35:28','Cobrancas Gerenciais',NULL,NULL,NULL,NULL),(35,'erros_inconsistencias','	select \r\n	     chave as CI, \r\n	     \"Campo Jira Inconsistente\" as \"Tipo de Erro\", \r\n	      jira as Erro \r\n	from \r\n	     cis \r\n	where \r\n	      jira like \"%http%\" \r\n\r\nunion\r\n\r\n	(select \r\n	     chave as CI, \r\n	     \"Owner vazio\" as \"Tipo de Erro\", \r\n	     owner as Erro \r\n	from \r\n	     cis \r\n	where \r\n	    cis.owner is null or \r\n	    cis.owner=\'\' \r\n\r\n	order by cis.owner desc)\r\n\r\nunion\r\n\r\n	(select \r\n	    cis.chave as CI,\r\n	   \"Link sem Monitoracao\" as \"Tipo de Erro\", \r\n	    left(atributos.valor,30) as Erro  \r\n	from \r\n	    cis,  \r\n	    atributos\r\n	where \r\n	   atributos.dicdado_id = 8 and\r\n	   atributos.ci_id = cis.id and \r\n	  atributos.valor not like \"http%\" \r\n\r\n\r\n	order by atributos.valor)\r\n\r\nunion\r\n\r\n	(select \r\n	     chave as CI, \r\n	     \"Link sem Documentacao\" as \"Tipo de Erro\", \r\n	     \'\' as Erro \r\n	from \r\n	     cis \r\n	where \r\n	    (cis.owner is null or \r\n	    cis.url=\'\') and\r\n	    cis.tipoci_id=14\r\n\r\n\r\n	order by cis.owner desc)\r\n','2014-05-16 16:58:32','2014-08-01 15:24:11','CIS com erros de inconsistencia',NULL,NULL,NULL,NULL),(36,'temp_campos_monit','select\r\n        cis.chave as CI,\r\n        left(cis.descricao ,30) as Nome,\r\n\r\n        MAX(IF(atributos.dicdado_id = 8, atributos.valor, NULL)) as \"Utilizacao\" ,\r\n        MAX(IF(atributos.dicdado_id = 17, atributos.valor, NULL)) as \"Monit Operad\" ,\r\n        MAX(IF(atributos.dicdado_id = 152, atributos.valor, NULL)) as \"Monitoracao\" \r\n  \r\n    from\r\n        cis,\r\n        atributos,\r\n        sites,\r\n        tipocis\r\n     where\r\n        cis.tipoci_id=14 and\r\n        atributos.ci_id = cis.id and\r\n        cis.tipoci_id = tipocis.id\r\n      group by\r\n        cis.chave\r\n      order by\r\n        cis.chave;','2014-05-16 18:08:34','2014-05-16 18:08:34','mostra os 3 campos de monit',NULL,NULL,NULL,NULL),(37,'Celulares','select\r\n        cis.chave as CI,\r\n        left(cis.descricao ,30) as Nome,\r\n        cis.Owner as Owner,\r\n        Notificacao as \"Usuario\",\r\n        MAX(IF(atributos.dicdado_id = 242, atributos.valor, NULL)) as \"Dedicado?\",\r\n        MAX(IF(atributos.dicdado_id = 173, atributos.valor, NULL)) as \"Operadora\"\r\n     \r\n    from\r\n        cis,\r\n        atributos\r\n     where\r\n        cis.tipoci_id=37 and\r\n        atributos.ci_id = cis.id \r\n        \r\n        \r\n      group by\r\n        cis.chave\r\n      order by\r\n        cis.chave\r\n      ; ','2014-05-28 18:15:03','2014-08-13 16:36:13','',NULL,NULL,NULL,NULL),(38,'CIOrfaos','select \r\n   cis.chave as CI,\r\n   statuscis.status,\r\n   cis.descricao as descricao, \r\n   tipocis.tipo as tipo \r\nfrom \r\n   cis,\r\n   tipocis,\r\n   statuscis\r\nwhere \r\n   cis.tipoci_id = tipocis.id and \r\n   cis.statusci_id = statuscis.id and\r\n   cis.id not in (\r\n              select \r\n                   impactado_id \r\n              from \r\n                   relacionamentos \r\n             union \r\n              select \r\n                   dependente_id \r\n              from \r\n                   relacionamentos) \r\norder by \r\n   tipocis.tipo;\r\n','2014-05-30 15:08:31','2014-06-03 19:16:34','CIs sem nenhum relacionamento',NULL,NULL,NULL,NULL),(39,'CIsNaoAtivos','select \r\n    chave as id, \r\n    cis.descricao,\r\n    tipocis.tipo as tipo,  \r\n    statuscis.status as status, \r\n    cast(datediff(now(),cis.updated_at) as char) as dias \r\nfrom \r\n    cis, \r\n    tipocis, \r\n    statuscis \r\nwhere \r\n    cis.statusci_id = statuscis.id and \r\n    statusci_id <> 1 and \r\n    datediff(now(),cis.updated_at) > 30 and \r\n    cis.tipoci_id = tipocis.id ;\r\n','2014-05-30 16:03:10','2014-06-03 19:32:22','CIs nao ativos (em mudanca, cancelado) ha mais de 30 dias',NULL,NULL,NULL,NULL),(40,'FaturasVencendoSemanaQueVem','\r\n(select \r\n   cis.chave as ID, \r\n   cis.descricao,\r\n   cast(cast(cis.CustoMensal*100 as decimal(10,0) )as char)  as \"Custo Mensal\",\r\n   MAX(IF(atributos.dicdado_id = 186, atributos.valor, NULL)) as Vencimento \r\nfrom \r\n  cis,\r\n  atributos \r\nwhere \r\n   atributos.ci_id = cis.id and\r\n   cis.id in ( \r\n      select ci_id  from atributos where \r\n            valor >= dayofmonth(now() + interval (7-dayofweek(now())) day)  and \r\n            dayofmonth(now() + interval (7-dayofweek(now())) day) > dayofmonth(now() + interval (15-dayofweek(now())) day) and \r\n            dicdado_id = 186)\r\n\r\ngroup by cis.chave\r\n\r\norder by vencimento\r\n)\r\nunion \r\n(\r\nselect \r\n   cis.chave as ID, \r\n   cis.descricao,\r\n   cast(cast(cis.CustoMensal*100 as decimal(10,0) )as char)  as \"Custo Mensal\",\r\n   MAX(IF(atributos.dicdado_id = 186, atributos.valor, NULL)) as Vencimento \r\nfrom \r\n  cis,\r\n  atributos \r\nwhere \r\n   atributos.ci_id = cis.id and\r\n   cis.id in ( \r\n      select ci_id  from atributos where \r\n            valor >= dayofmonth(now() + interval (7-dayofweek(now())) day)  and \r\n            valor <= dayofmonth(now() + interval (15-dayofweek(now())) day) and \r\n            dicdado_id = 186)\r\n\r\ngroup by cis.chave\r\norder by vencimento\r\n)\r\nunion \r\n(\r\nselect \r\n   cis.chave as ID, \r\n   cis.descricao,\r\n   cast(cast(cis.CustoMensal*100 as decimal(10,0) )as char)  as \"Custo Mensal\",\r\n   MAX(IF(atributos.dicdado_id = 186, atributos.valor, NULL)) as Vencimento \r\nfrom \r\n  cis,\r\n  atributos \r\nwhere \r\n   atributos.ci_id = cis.id and\r\n   cis.id in ( \r\n      select ci_id  from atributos where \r\n            dayofmonth(now() + interval (15-dayofweek(now())) day) < dayofmonth(now() + interval (7-dayofweek(now())) day)  and \r\n            valor <= dayofmonth(now() + interval (15-dayofweek(now())) day) and \r\n            dicdado_id = 186)\r\n\r\ngroup by cis.chave\r\norder by vencimento)\r\n;','2014-06-11 21:38:51','2014-07-15 16:24:25','Faturas que vencem na proxima semana',NULL,NULL,NULL,NULL),(41,'FaturasExistentes','select \r\n   cis.chave as ID, \r\n   cis.descricao,\r\n   cast(cast(cis.CustoMensal*100 as decimal(10,0) )as char)  as \"Custo Mensal\",\r\n   MAX(IF(atributos.dicdado_id = 186, atributos.valor, NULL)) as \"Dia Venc\" ,\r\n   MAX(IF(atributos.dicdado_id = 187, atributos.valor, NULL)) as \"Venc contrato\" ,\r\n   statuscis.status as \"Status\",\r\n   MAX(IF(atributos.dicdado_id = 189, atributos.valor, NULL)) as \"Pre Aprov\",\r\n   MAX(IF(atributos.dicdado_id = 190, atributos.valor, NULL)) as \"Debito Automat\"\r\nfrom \r\n\r\n  cis left join atributos on atributos.ci_id = cis.id\r\n  left join statuscis on statuscis.id = cis.statusci_id \r\nwhere \r\n\r\n   cis.tipoci_id = 40\r\n\r\ngroup by cis.chave\r\norder by cis.chave;','2014-06-16 19:00:02','2014-07-15 16:26:26','Faturas existentes',NULL,NULL,NULL,NULL),(42,'CobrancasGerenciais','select CCdebito as \"Centro de Custos\",ProjetoDebito as \"Projeto\",descricao, cast(cast(cis.CustoMensal*-100 as decimal(10,0) )as char) as Despesa, descricaocobranca as \"Descricao Gerencial\", chave  as CI from cis where cobrar = 1 \r\n\r\nunion\r\n\r\nselect CCCredito as \"Centro de Custos\",ProjetoCredito as \"Projeto\",descricao,cast(cast(cis.CustoMensal*100 as decimal(10,0) )as char) as Despesa, descricaocobranca as \"Descricao Gerencial\", chave  as CI from cis where cobrar = 1 ;','2014-06-17 13:36:37','2014-06-17 13:59:17','Cobrancas Gerenciais Mensais',NULL,NULL,NULL,NULL),(49,'ServReaisTagdeAtivoV4','select \r\n  cis.chave as CI, \r\n  statuscis.status,\r\n  left(cis.descricao,30) as Descricao,\r\n  sites.nome as Site, \r\n  MAX(IF(atributos.dicdado_id = 14, atributos.valor, NULL)) as TAG,\r\n  MAX(IF(atributos.dicdado_id = 192, atributos.valor, NULL)) as Ativo,\r\n  MAX(IF(atributos.dicdado_id = 193, atributos.valor, NULL)) as \"Data Aquisicao\",\r\n  MAX(IF(atributos.dicdado_id = 194, atributos.valor, NULL)) as \"Custo Aquisicao\"\r\n\r\nfrom cis, \r\n  atributos,\r\n  sites,\r\n  tipocis,\r\n  statuscis\r\n\r\nwhere \r\n    cis.tipoci_id=9 and\r\n    atributos.ci_id = cis.id and \r\n    cis.site_id = sites.id and \r\n    cis.tipoci_id = tipocis.id and\r\n    cis.statusci_id = statuscis.id\r\n\r\ngroup by\r\n        cis.chave\r\n\r\n\r\norder by  Site ;','2014-07-03 13:31:08','2014-08-12 13:52:39','Servidores Reais Tag de Ativos',NULL,NULL,NULL,NULL),(53,'Links-All','select\r\n        cis.id as ID,\r\n        cis.chave as CI,\r\n        cis.descricao as Descricao,\r\n        statuscis.status as Status,\r\n        cast(cobrar as char) as Cobrar,\r\n         cast(cast(cis.CustoMensal*100 as decimal(10,0) )as char)  as \"Custo Mensal\",\r\n        MAX(IF(atributos.dicdado_id = 1, atributos.valor, NULL)) as Banda,\r\n        MAX(IF(atributos.dicdado_id = 3, atributos.valor, NULL)) as Designacao,\r\n        MAX(IF(atributos.dicdado_id = 2, atributos.valor, NULL)) as \"Endereco Ponta A\",\r\n        MAX(IF(atributos.dicdado_id = 114, atributos.valor, NULL)) as \"Endereco Ponta B\"       \r\n    from\r\n        cis,\r\n        atributos,\r\n        statuscis,\r\n        tipocis\r\n     where\r\n        cis.tipoci_id=14 and\r\n        atributos.ci_id = cis.id and\r\n        statuscis.id = cis.statusci_id and\r\n        cis.tipoci_id = tipocis.id\r\n \r\n       \r\n      group by\r\n        cis.chave\r\n      order by\r\n        Designacao;\r\n\r\n# cis.descricao like \'%level3%\' and','2014-07-24 18:55:18','2014-09-09 20:32:46','Todos os Links - Full - NAO Alterar - usado para provisionamento',NULL,NULL,'2014-09-09',NULL),(56,'VolumetriaTipoCI',' select \r\n    tipo, \r\n    cast(count(*) as char) as \"Quantidade\"\r\nfrom \r\n    cis,\r\n    tipocis \r\nwhere \r\n    tipoci_id = tipocis.id and\r\n    statusci_id =1\r\ngroup by \r\n    tipo;\r\n','2014-08-06 21:03:51','2014-08-07 17:58:31','Volumetria por tipo de CI AITVO',NULL,NULL,NULL,NULL),(57,'linhas_moveis_e_dados','select \r\n  cis.chave AS CI,\r\n  cis.descricao,\r\n  cis.ccdebito as \"CC Debito\",\r\n  cis.projetodebito as \"Projeto Debito\",\r\n  statuscis.status ,\r\n  cast(cis.cobrar as char) as Cobrar\r\n\r\nfrom cis,statuscis\r\nwhere (tipoci_id = 36 or tipoci_id = 37)\r\nand\r\ncis.statusci_id = statuscis.id\r\n','2014-08-08 14:45:20','2014-08-08 14:54:07','Linhas Moveis e dados',NULL,NULL,NULL,NULL),(58,'TodosCIS','select\r\n        cis.id as ID,\r\n        cis.chave as CI,\r\n        tipocis.tipo, \r\n        CCDebito,\r\n        ProjetoDebito,\r\n        CCCredito,\r\n        ProjetoCredito,\r\n        cis.descricao as Descricao,\r\n        statuscis.status as Status,\r\n        cast(cobrar as char) as Cobrar,\r\n        cast(cast(cis.CustoMensal*100 as decimal(10,0) )as char)  as \"Custo Mensal\"\r\n        \r\nfrom\r\n        cis,\r\n        statuscis,\r\n        tipocis\r\nwhere\r\n        statuscis.id = cis.statusci_id and\r\n        cis.tipoci_id = tipocis.id\r\ngroup by\r\n        cis.chave\r\n     ','2014-08-08 15:29:52','2014-08-08 15:39:05','Todos os CIs - para relatorio erro provisao Cesar',NULL,NULL,NULL,NULL),(59,'RM2Escritorio','select de,para from custom_de_paras where tipo=\"RM\"','2014-08-12 14:51:04','2014-08-12 14:51:04','Consulta para normalizar escritorios do RM ',NULL,NULL,NULL,NULL),(60,'MG2Escritorio','select de,para from custom_de_paras where tipo=\"Mediagw\"','2014-08-12 14:51:48','2014-08-12 14:51:48','Consulta De Para Mediagateway nome do escritorio',NULL,NULL,NULL,NULL),(61,'Servidor_a_liberar','select ID,Owner,CI,Descricao,status,cast(DataLiberacao as char) from \r\n\r\n(select\r\n     \r\n        cis.id as ID,\r\n        cis.Owner as Owner,\r\n        cis.chave as CI,\r\n        cis.descricao as Descricao,\r\n        statuscis.status as Status,  \r\n        str_to_date(MAX(IF(atributos.dicdado_id = 27, atributos.valor, NULL)),\'%d/%m/%Y\') as DataLiberacao       \r\n    from\r\n        cis,\r\n        atributos,\r\n        statuscis,\r\n        tipocis\r\n     where\r\n        cis.tipoci_id=32 and\r\n        atributos.ci_id = cis.id and\r\n        statuscis.id = cis.statusci_id and\r\n        cis.tipoci_id = tipocis.id\r\n \r\n       \r\n      group by\r\n        cis.chave) as tab\r\nwhere DataLiberacao is null or (DataLiberacao < CURDATE() - INTERVAL 60 DAY) and\r\nstatus = \"Ativo\"\r\n\r\n\r\n#SELECT id, GROUP_CONCAT(string SEPARATOR \' \') FROM table GROUP BY id;','2014-08-14 20:07:16','2014-08-14 20:26:43','Servidores sem data de liberacao ou a liberar (<60dias)',NULL,NULL,NULL,NULL),(62,'Link_Operadora','select\r\n        cis.chave as CI,\r\n        fornecedores.nome as Fornecedor,\r\n        cis.descricao as Descricao\r\n                       \r\n    from\r\n        cis,\r\n        atributos,\r\n        contratos,\r\n        fornecedores,\r\n        tipocis\r\n     where\r\n        cis.tipoci_id=14 and\r\n        atributos.ci_id = cis.id and\r\n        cis.contrato_id = contratos.id and\r\n        contratos.fornecedor_id = fornecedores.id and\r\n        cis.tipoci_id = tipocis.id\r\n       \r\n      group by\r\n        cis.chave\r\n\r\norder by CI','2014-08-15 22:18:40','2014-08-15 22:32:53','Link e Operadora',NULL,NULL,NULL,NULL);
