INSERT INTO `sql_templates` VALUES (2,'Alerta aberto pelo NOC....\r\n\r\n<p>\r\n  	\r\n<% if @obj.ci %>\r\n  <p><%= \"CI: #{@obj.ci.chave}\" =%>\r\n  \r\n<% end %>\r\n\r\n<p><b>Evento:</b><%= @obj.nome %>\r\n<p><b>Descricao:</b><%= content_tag(\'pre\',@obj.description) %>\r\n\r\n<p><b>Alerta Publico ?</b><%= @obj.publica ? \'Sim\' : \'Nao\' %>\r\n<p><b>Tipo de Alerta:</b><%= @obj.tipotask %>\r\n<p><b>Status do Alerta:</b><%= @obj.status %>\r\n<p><b>Criticidade:</b><%= @obj.criticidade.name %>\r\n<p><b>Status:</b><%= \"#{@obj.status} em #{@obj.criado_em} por #{@obj.author.name}\" %>\r\n<p><b>Fornecedor:</b><%= @obj.fornecedor.nome %>\r\n<p><b>Chamado:</b><%= @obj.chamado %>\r\n<p><b>Solicitante:</b><%= @obj.solicitante %>\r\n<p><b>Cliente:</b><%= @obj.category.name %>\r\n<p><b>Site:</b><%= @obj.site.nome %> ','ci_mailer/alerta_incidente','html','en','erb',0,'0000-00-00 00:00:00','2014-04-28 19:44:53'),(4,'<h1>Problema com servidor</h1>\r\n\r\nBom dia, \r\n\r\nO seguinte servidor esta com problema. Favor entrar em contato com o NOC no ramal (21xxxz):\r\n\r\n<p><%= \"#{@obj.tipoci.tipo}:#{@obj.chave}\" %>,</p>\r\n<p>Descricao: <%= @obj.descricao %>,</p>\r\n<p>Responsavel: <%= @obj.Owner %>,</p>\r\n<p>IP: <%= @obj._IP %></p>\r\n<p>Servicos existente nesse servidor: <%= @obj._Servicos %></p>\r\n\r\nObrigado','ci_mailer/problema_servidor','html','en','erb',0,'0000-00-00 00:00:00','2014-04-28 19:46:02'),(5,'<h1>Revalidação de Servidores</h1>\r\n\r\nBom dia, \r\n\r\nPrecisamos revalidar algumas informações do servidor abaixo:\r\n\r\n<p>Descricao: <%= @obj.descricao %>,</p>\r\n<p>Responsavel: <%= @obj.Owner %>,</p>\r\n<p>IP: <%= @obj.atributos[6][1] %></p>\r\n<p>Servicos existente nesse servidor: <%= @obj.atributos[9][1] %></p>\r\n\r\n<h2>Por favor, responda a esse email validando as informações acima.</h2>\r\n\r\nObrigado pela ajuda\r\nBRQ IT Services','ci_mailer/revalidar_servidor','html','en','erb',0,'0000-00-00 00:00:00','2014-04-28 19:28:57'),(7,'<p>Prezado Gestor,\r\n<p>\r\n<p>Buscando otimizar a utilização de softwares licenciados em nosso ambiente, solicito que informe quais colaboradores da lista abaixo, possuem a necessidade de instalação do software Visual Studio, em seus equipamentos. Essa ação visa diminuirmos o número de licenças instaladas desnecessariamente e consequentemente, a redução de custo de cada licença para o projeto.\r\n\r\n<p>Aguardamos o retorno, até o dia <b>28/07</b>. Lembrando que a qualquer necessidade de instalação do software, favor entrar em contato com nossa Central de Suporte, através do <b>Servicedesk (Ramal 219898).</b>\r\n<p>\r\n<p><p><p><b>Usuários:</b>\r\n\r\n<% @obj.body.split(\";\").each do |u| %>\r\n<p>- <%=u%>\r\n<% end %>\r\n<p>\r\n<p>\r\n<p>Obrigado,\r\n<p>\r\n<p>Atenciosamente<br>\r\n\r\n<a href=\"http://www.brq.com\"><img itemprop=\"logo\" src=\"http://sitebeta.brq.com/wp-content/uploads/2013/11/logo-brq.png\" alt=\"\" align=\"left\"/></a><p><br><br>\r\n<b><p><br>Gestão MICROINFORMATICA\r\n<p>Servicedesk 24x7 - Telefonia\r\n<p>BRQ IT Services  </b>\r\n\r\n\r\n  ','ci_mailer/revalidar_vs','html','en','erb',0,'2014-07-18 13:46:23','2014-07-22 13:22:23'),(8,'<p>Prezado Gestor,\r\n<p>\r\n<p>Seu WindowXP vai ser atualizado\r\n\r\n<p>Aguardamos o retorno, até o dia <b>28/07</b>. Lembrando que a qualquer necessidade de instalação do software, favor entrar em contato com nossa Central de Suporte, através do <b>Servicedesk (Ramal 219898).</b>\r\n<p>\r\n<p><p><p><b>Usuários:</b>\r\n\r\n\r\n<p>\r\n<p>Obrigado,\r\n<p>\r\n<p>Atenciosamente<br>\r\n\r\n<a href=\"http://www.brq.com\"><img itemprop=\"logo\" src=\"http://sitebeta.brq.com/wp-content/uploads/2013/11/logo-brq.png\" alt=\"\" align=\"left\"/></a><p><br><br>\r\n<b><p><br>Gestão MICROINFORMATICA\r\n<p>Servicedesk 24x7 - Telefonia\r\n<p>BRQ IT Services  </b>\r\n<p>Tel.: (21) 3211-8834\r\n<p>Cel.: (21) 98094-3579\r\n\r\n  ','ci_mailer/atualizarXP','html','en','erb',0,'2014-07-21 14:37:30','2014-07-21 14:37:30'),(9,'<h1>Revalidação de Backup</h1>\r\n\r\nPrezado(a), <br>\r\n\r\nPrecisamos revalidar se o diretório informado na solicitação de criação do servidor continua sendo o correto. Caso contrário, favor informar o nome do novo caminho.\r\n\r\n<h2>Por favor, responda a esse email validando as informações acima.</h2>\r\n\r\nObrigado pela ajuda\r\nBRQ IT Services','ci_mailer/revalidar_backup','html','en','erb',0,'2014-07-21 17:53:26','2014-07-21 17:59:24'),(10,'<p>Prezado(a),\r\n<p>\r\n<p>Com objetivo de otimizarmos os recursos computacionais, estamos revalidando algumas informações referente aos nossos servidores. Como por exemplo, se o mesmo  encontra-se em uso mas que não possuem data de liberação ou já estão marcados para liberar.\r\n<p>\r\n<p>Por favor, informe para cada servidor abaixo:\r\n<p>- Se podemos liberar o servidor.\r\n<p>- Em caso negativo, uma data provável para liberação (< 12 meses)\r\n<p>- Caso você não seja o responsável pelo mesmo, favor reportar. \r\n<p>\r\n<p>Lembrando que infra NUNCA libera servidores sem aprovação do dono do servidor\r\n<p>\r\n<p>\r\n<p>----------------------------------------------------------------------------------------------------------------\r\n<% @obj.body.split(\";\").each do |u| %>\r\n<p>- <%=u%>\r\n<% end %>\r\n<p>\r\n<p>----------------------------------------------------------------------------------------------------------------\r\n<p>\r\n<p>Obrigado,\r\n<p>\r\n<p>Atenciosamente<br>\r\n\r\n\r\n\r\n<a href=\"http://www.brq.com\"><img itemprop=\"logo\" src=\"http://sitebeta.brq.com/wp-content/uploads/2013/11/logo-brq.png\" alt=\"\" align=\"left\"/></a><p><br><br>\r\n<b><p><br>Raphael Bleckmann de Sá Freire\r\n<p>BRQ IT Services - Infraestrutura\r\n<p>Tel: (21) 3211-8964\r\n<p>BRQ IT Services  </b>\r\n','ci_mailer/revalidar_servidor_a_ser_liberado','html','en','erb',0,'2014-08-07 19:13:01','2014-08-07 20:29:47'),(11,'<h1>Revalidacao de Servidores</h1>\r\n\r\n<p>Prezado(a),</p>\r\n\r\n<br>O servidor abaixo está marcado para ser eliminado.\r\n<br>Data de liberação informada =>  <%= @obj.atributos[27][1].blank? ? \"Expirado\" : @obj.atributos[27][1]  %>\r\n<br>\r\n<br>Esse servidor ainda está sendo utilizado ou podemos elimina-lo ?\r\n<br>Caso ainda seja necessário, qual a proxima data de liberação ?\r\n\r\nAdicionalmente, por favor, revalide as informações abaixo:\r\n\r\n<p>Descricao:<b><%= @obj.descricao %></b>\r\n<br>Responsavel:<b> <%= @obj.Owner %></b>\r\n<br>IP:<b> <%= @obj.atributos[6][1] %></b>\r\n<br>Servicos existente nesse servidor:<b> <%= @obj.atributos[9][1] %></b>\r\n\r\n<p><b>Observacoes:</b></p>\r\n\r\n\r\n<br>1) Caso as informacoes acima nao forem validadas no prazo de 1 semana, o servidor será desligado temporariamente.\r\n<br>2) Se as informacoes acima nao forem pertinentes, favor indicar nome do possivel responsavel.\r\n<br>3) Voce está recebendo esse email, pois está cadastrado como responsável por esse servidor.\r\n\r\n<p>Lembrando que infra NUNCA libera servidores sem aprovação do dono do servidor</p>\r\n\r\n<p>\r\n<p>Obrigado,\r\n<p>\r\n<p>Atenciosamente<br>\r\n\r\n\r\n\r\n<a href=\"http://www.brq.com\"><img itemprop=\"logo\" src=\"http://sitebeta.brq.com/wp-content/uploads/2013/11/logo-brq.png\" alt=\"\" align=\"left\"/></a><p><br><br>\r\n<b><p><br>Raphael Bleckmann de Sá Freire\r\n<p>BRQ IT Services - Infraestrutura\r\n<p>Tel: (21) 3211-8964\r\n<p>BRQ IT Services  </b>\r\n','ci_mailer/Liberar servidor','html','en','erb',0,'2014-08-15 18:05:25','2014-08-15 20:08:57');
/*!40000 ALTER TABLE `sql_templates` ENABLE KEYS */;
UNLOCK TABLES;

