1:11','2013-07-16 19:54:19',0,NULL,'','[Manutenção Servidor RM]',47,'',1,'Info',NULL,'',NULL,NULL,6),(804,'A MPLS do Rio esta muito sobrecarregada deste o inicio do dia impactando vários serviços.\r\n\r\nIdentificamos também que o trafego maior esta entre Rio e Curitiba partindo do servidor rjserver159 (Office Scan) para varias estações em CWB \r\n\r\nComo solução paliativa o servidor foi desligado conforme combinado com o responsável pelo mesmo.\r\n\r\n\r\nSegue a evidencia do trafego',23,1,5,3,'2013-07-12 18:24:42','2013-07-17 22:22:37',0,NULL,'','[Degradação MPLS rio de janeiro]',47,'',0,'Incidente',NULL,'',NULL,NULL,5),(805,'Devido a preparação para instalação do novo link da Cielo, toda a rede de Murano ficará indisponível no domingo, 14/07, das 20hs às 22hs.',6,1,5,11,'2013-07-12 19:45:01','2013-07-16 19:40:27',0,NULL,'','Manutenção Rede]',47,'',0,'Mudança',NULL,'',NULL,NULL,3),(806,'Área responsável realizando as devidas verificações relacionado ao licenciamento dos servidores dedicados ao VDI Itaú.',23,1,4,1,'2013-07-15 14:33:35','2013-07-23 20:24:03',0,NULL,'','[Instabilidade] VDI Itaú.',47,'',0,'Incidente',NULL,'Realizado reparo nos servidores com problemas de licença, aplicação continua em análise.',NULL,NULL,5),(807,'Notificado ao suporte local de BV.',23,1,4,5,'2013-07-15 14:43:48','2013-07-17 22:21:16',0,NULL,'','[Alerta] Wireless.BV.3 - 2º Andar.central',47,'',0,'Incidente',NULL,'',NULL,NULL,6),(808,'Servidor apresentando 5% livre. Notificada a área responsável.\r\n',1,1,4,2,'2013-07-15 15:47:01','2013-07-16 19:56:24',0,NULL,'','[Alerta] spserver248.Book.Financenceiro.Disco.D',47,'',0,'Info',NULL,'',NULL,NULL,1),(809,'Estamos recebendo reclamações dos colaboradores em relação a uma degradação no ambiente Panamérica Park voltadas a Rede interna, a princípio MPLS e Internet estavam operando em sua normalidade.\r\nEstamos aguardando uma análise do ambiente.',23,1,4,9,'2013-07-15 21:00:15','2013-07-22 17:27:17',0,NULL,'','[Degradação] Análise Ambiente Panamérica Park.',47,'',0,'Incidente',NULL,'',NULL,NULL,1),(810,'Configuração de novo switch de distribuição, o mesmo fará o uplink do 2º para o 6º andar.\r\n\r\nImpacto: possíveis pequenas oscilações em 30 maquinas',1,1,5,5,'2013-07-16 19:42:17','2013-07-18 17:35:13',0,NULL,'','[Novo Switch]',47,'',0,'Mudança',NULL,'',NULL,NULL,3),(811,'Sap entrará em manutenção de 20hs às 21:30hs para ajustes do bkp via SQLSERVER.',2,1,5,3,'2013-07-16 19:44:01','2013-07-17 15:04:14',0,NULL,'','[Manutenção SAP Produção]',47,'',0,'Mudança',NULL,'Não conseguimos incluir um disco de rede compartilhado na maquina do SAP para fazer o backup do SQL Server.\r\nVoltamos os serviços para o ar sem fazer nada.\r\nAs opções são:\r\n1) Aumentar um dos volumes existentes para que caiba o Backup.\r\n2) Criar um novo Volume iSCSI  e adiciona-lo ao Cluster.\r\n',NULL,NULL,4),(812,'Hoje, entre 22hs e 05hs de amanhã, a rede de VO estará em manutenção.\r\n\r\nDevido a essa atividade, alguns serviços poderão apresentar períodos de indisponibilidade de 10min à 1hr.\r\n\r\n• Todas as unidades - Site BRQ e Citrix;\r\n• BRQ Vila Olímpia - Data Center (Servidores, telefonia, VPN, internet e links de cliente);\r\n• BRQ Boa Vista - Telefonia;\r\n• BRQ Alphaville - Telefonia e alguns serviços do Bradesco; \r\n• BRQ Curitiba - Telefonia;\r\n• BRQ Panamerica Park - Telefonia; \r\n• BRQ Murano - Telefonia e acesso Cielo;\r\n• BRQ Brasília - Telefonia;\r\n• BRQ Fortaleza - Telefonia;\r\n• BRQ Vargas - Mainframe Citibank. O mesmo poderá ser acessado remotamente pelos usuários que\r\ntenham o RemoteOffice.',6,1,5,1,'2013-07-17 17:20:15','2013-07-19 18:41:23',0,NULL,'','[Manutenção Rede VO]',47,'',0,'Mudança',NULL,'Os seguintes links ficaram faltando ser recuados:\r\n\r\nLink Cielo\r\nLink Citibank\r\nTelfonia\r\n\r\nUma nova janela será agendada',NULL,NULL,6),(813,'16:00hrs Serviço de Internet normalizado, ocorreu um erro de configuração na própria operadora.\r\n\r\n15:03Hs - Feedback - A engenharia da GVT já está trabalhando para resolver o problema, não foi informado prazo.\r\n-----------------------------------------------------------\r\n14:48Hs - Falha massiva constatada e o gerente de contas foi acionado.\r\n\r\nAguardamos feedback do mesmo.\r\n-----------------------------------------------------------\r\n14:11Hs - Estamos recebendo alguns alertas relativos ao Link Gmail GVT.\r\n\r\nJá estamos em contato com a operadora analisando o link.',23,1,4,4,'2013-07-17 17:32:16','2013-07-22 17:28:25',0,NULL,'','[Serviço Internet Marechal/Kennedy]',4,'',1,'Incidente',NULL,'',NULL,NULL,6),(814,'E-mail notificando a área responsável:\r\n\r\nEstamos recebendo dois alertas em nosso painel de monitoração, todos os nossos links estão operando em sua normalidade.\r\n\r\nO ambiente Cielo está sofrendo impacto neste momento? Conseguimos um canal direto para interação relacionado aos servidores da própria Cielo?\r\n\r\nVIS.Cielo - Via Murano   Host: 10.50.52.51 Port: 1433\r\n\r\nMainframe SEC.Homologação 1.Cielo - Via Murano   Host: 10.90.7.122  Port 992',23,1,4,11,'2013-07-18 11:51:59','2013-07-23 20:23:25',0,NULL,'','[Alarmes] Vis.Cielo / Mainframe Sec. Homologação',47,'',0,'Info',NULL,'Problema de configuração, falta de rotas na localidade; ',NULL,NULL,6),(815,'Manutenção no SAP Produção para ajustes de bkp via sqlserver \r\n\r\nA manutenção acontecerá HOJE das 20hs às 21:30 ',2,1,5,1,'2013-07-18 17:23:45','2013-07-22 13:40:34',0,NULL,'','[Manutenção SAP Produção]',47,'',0,'Info',NULL,'',NULL,NULL,3),(816,'19/07/2013 \r\nRealizei o contato junto a operadora e após análise, recebi o retorno que o nosso circuito foi afetado por uma degradação de fibra.\r\n\r\nIncidente gerado devido a uma falha no backbone da level (3) entre SP e Rio, como o circuito da BRQ possuí proteção, ocorreu uma conversão para outro Anel causando uma oscilação momentânea, porém mantendo o nosso serviço disponível.\r\n\r\n\r\n\r\n-Hoje pela manhã sofremos com uma oscilação no link de MPLS entre 10:40 as 10:50h.\r\nEstamos com um chamado aberto junto a operadora, foi identificada uma oscilação, estamos no aguardo da análise dos logs.',23,1,4,2,'2013-07-18 19:12:39','2013-07-23 20:25:51',0,NULL,'','[Incidente] Oscilação MPLS.',23,'6818640',1,'Incidente',NULL,'servicedesknmpt por  brq.com \r\n18:12 (17 minutos atrás)\r\n\r\npara ale, noc, nsantos, djunqueira, leandrocaron, dc, Bruno, Jacquelline, Mauricio \r\nPrezado cliente,\r\n \r\nDetectamos um alerta e efetuamos a abertura de um incidente para a localidade BRQ - São Paulo - Dados:\r\n \r\nINCIDENTE:  6818640\r\nRESUMO:  Cliente solicita RFO para período de indisponibilidade observado em 18/07/2013 por volta das 10:30 hs\r\nSERVIÇO: MPLS\r\nDESIGNAÇÃO: P17059\r\nSINTOMA:  Indisponibilidade de serviço no período citado acima impactando produtividade de usuários.\r\nAFETAÇÃO: Disponível no momento.\r\nSEVERIDADE/IMPACTO:  ALTA\r\nPRIORIDADE:  ALTA\r\nAÇÃO/INFORMAÇÃO:  Incidente encaminhado ao time de Assurance Level 3 para averiguação.\r\n \r\nEm caso de dúvidas, favor entrar em contato com nossa central através do 0800-772-4266 ou pelo e-mail servicedesknmpt@level3.com\r\n \r\nThanks/ Saludos Cordiales / Atenciosamente,',NULL,NULL,6),(817,'Migração do Riverbed da Vila do DC 6º para o Mini-DC no 3º',1,1,5,2,'2013-07-18 19:14:02','2013-07-22 15:12:57',0,NULL,'','Shutdwn no Riverbed de Vila (16:18)',47,'',0,'Mudança',NULL,'',NULL,NULL,6),(818,'Re-ativar o Riverbed em Vila pós mudança da MPLS do 6º para o 3º\r\n\r\nDeve gerar uma pequena oscilação na MPLS de Vila',1,1,4,2,'2013-07-18 21:17:19','2013-07-22 13:40:44',0,NULL,'','[MPLS VILA] Mudar cabo para Riverbed (19hrs)',47,'',0,'Mudança',NULL,'',NULL,NULL,3),(819,'\r\n\r\n14:15 - Um Técnico foi enviado para análise do armário da GVT, caso necessário procederá até o local da instalação para verificação.\r\n------------------------------------------------------------\r\n\r\nIncidente ocorreu por volta das 11:00h.\r\nReincidente às 17:00h\r\n\r\nLink normalizado, continuaremos monitorando.',23,1,1,1,'2013-07-18 22:06:44','2013-07-22 17:31:13',0,NULL,'','[Incidente] Falha Massiva Internet Natal - RN',47,'180720134680972 170720133890178 190720135218130   190720135314547',0,'Incidente',NULL,'19/07/13 15:44\r\n\r\nEntramos em contato junto a GVT e recebemos o retorno que o técnico local estava em campo para realizar as devidas verificações no armário.\r\n\r\nNeste momento entrei em contato com o Analista Ricardo Leão e o Link está operando em sua normalidade, ainda não possuímos um retorno da operadora informando a normalização definitiva do serviço.\r\n\r\nQualquer eventualidade favor nos informar.\r\n\r\nSeguiremos acompanhando este incidente.\r\n\r\n------------------------\r\n<ricardoleao@brq.com>\r\n\r\nAdson,\r\n \r\nRealizei contato com a GVT e me informaram que foi reaberto o chamado para a visita técnica, repassaram o prazo de 24H e especificaram a urgencia por se tratar de empresa e não ter sido atendido pelo chamado anterior.',NULL,NULL,6),(820,'Pessoal,\r\n\r\nO Danilo me informou que algumas maquinas de Vargas estavam pegando IP na rede 10.2.108 percebi que o serviço DHCP do novo SQUIDVARGAS estava no ativo.. Parei o Serviço DHCP neste do novo SQUID e as maquinas voltaram a pegar IP na rede 10.2.16.0/21.\r\n\r\nPara os usuários que enfrentarem este problema devemos orienta-los a reiniciar o desktop.',23,1,4,3,'2013-07-19 13:00:27','2013-07-23 20:26:41',0,NULL,'','Gateway Máquinas Vargas.',47,'',0,'Incidente',NULL,'Prezados,\r\n\r\nBom dia,\r\n\r\nConforme conversamos, o Analista Hugo realizou uma análise no 8° andar e está se dirigindo ao 2° andar para ter uma métrica do impacto gerado, caso o número de chamados e ligações tenham um aumento significativo, favor informar o mais breve possível para que seja enviado um comunicado para localidade com as devidas orientações para os colaboradores..\r\n\r\nObs: As máquinas que não foram desligadas não sofreram impacto.\r\nPara os usuários que enfrentarem este problema devemos orienta-los a reiniciar o desktop.',NULL,NULL,6),(821,'Devido a substituição dos no-braks do 2º andar de BV, todo o  DC da localidade ficará off de 08hs às 12hs do próximo domingo. ',1,1,3,5,'2013-07-19 18:48:03','2013-07-22 18:43:52',0,NULL,'','[Manutenção no-break BV]',47,'',0,'Info',NULL,'',NULL,NULL,3),(822,'No domingo, 21/07, será realizada uma manutenção em alguns serviços em VO. Essa janela começará às 20hs e término às 05hs do dia 22/07. Segue abaixo, o que será impactado:\r\n\r\n• BRQ Vila Olímpia - Telefonia, Link Cielo e Citibank\r\n• BRQ Boa Vista - Telefonia;\r\n• BRQ Alphaville - Telefonia;\r\n• BRQ Curitiba - Telefonia;\r\n• BRQ Panamerica Park - Telefonia; \r\n• BRQ Murano - Telefonia e acesso a Cielo;\r\n• BRQ Brasília - Telefonia;\r\n• BRQ Fortaleza - Telefonia;\r\n• BRQ Vargas - Mainframe Citibank. O mesmo poderá ser acessado remotamente pelos usuários que\r\ntenham o RemoteOffice.',6,1,3,2,'2013-07-19 18:51:50','2013-07-23 13:29:46',0,NULL,'','[Manutenção Rede VO]',47,'',0,'Mudança',NULL,'Links E1, Cielo e Citibank foram movidos para o andar do mini-dc.',NULL,NULL,3),(823,'Hoje, os seguintes servidores Notes serão desligados:\r\n\r\nNOTESNG, DOMINOSP1, SPSERVER2',2,1,5,1,'2013-07-19 18:58:37','2013-07-22 13:46:31',0,NULL,'','[Desligamento servidores Notes]',47,'',0,'Info',NULL,'Mudança não pode ser realizada, pois foi verificado que o SI e as impressoras estavam utilizando os servidores Notes que iriam ser desligados como SMTP server.\r\n\r\n',NULL,NULL,2),(824,'Migração dos No-breaks do DC em BV',1,1,3,5,'2013-07-21 10:56:19','2013-07-22 18:43:36',0,NULL,'','PARADA DC BV - 08 AS 12HRS (21/07)',47,'',0,'Mudança',NULL,'',NULL,NULL,3),(825,'Problemas na localidade, aguardando análise da área responsável.',23,1,4,5,'2013-07-22 18:05:42','2013-08-05 15:21:19',0,NULL,'','[Análise Ambiente Boa Vista]',47,'',0,'Incidente',NULL,'Network Operation Center <noc@brq.com>\r\n16:47 (2 horas atrás)\r\n\r\npara servicedesk, suportebrq, telefonia, dc \r\nPrezados,\r\n\r\nBoa Tarde,\r\n\r\nO Incidente ocorreu devido a uma falha elétrica causada por uma tomada queimada do No Break, impactando todos os serviços da localidade.\r\nTempo de indisponibilidade do Site: 15:00hrs – 15:25hrs.\r\n\r\n*Devido a migração dos No Breaks para o 6° andar, o DC está atuando apenas com um temporariamente.\r\n',NULL,NULL,6),(826,'-\r\nPrezados, o serviço voltou a operar em sua normalidade as 09:25hrs. Continuamos interagindo junto ao Gerente de contas buscando a descrição da solução.\r\n\r\nEsta falha foi identificada hoje em nosso check-list de Telefonia realizado às 07:00hrs, o chamado já foi aberto junto a nossa mantenedora.',23,1,5,7,'2013-07-23 12:17:55','2013-08-05 15:22:04',0,NULL,'','[Incidente] Falha massiva 0800 CEF',4,'16439',1,'Incidente',NULL,'Bom dia, Senhores Estamos com os serviços abaixo indisponíveis. Necessito da verificação urgente junto a operadora. 08000815121 -> CNPJ -> 36542025000830 \r\n08006008002 -> CNPJ -> 36542025000164 \r\n\r\nAté o momento não recebemos nenhuma descrição da solução do problema.',NULL,NULL,6),(827,'Links Normalizados às 11:20h, continuamos interagindo junto a operadora em busca da descrição da solução.\r\n\r\nEstamos com uma inidisponibilidade em 2 links da GVT em Marechal. \r\n\r\nOs links são a MPLS e o link de Internet dedicado (10 MB).\r\n\r\nNeste momento estamos operando via VPN automatica.\r\n\r\nA VPN com o itaú esta off devido ao problema e já orientamos as equipes a utilizarem os acessos pelos endereços de VILA.',23,1,5,4,'2013-07-23 12:52:50','2013-07-29 13:51:30',0,NULL,'','Indisponibilidade MPLS e Internet Marechal',4,'874264201307231018 874243201307231013',1,'Incidente',NULL,'Link:\r\nInternet: 874264201307231018   \r\nMPLS:     874243201307231013     \r\n',NULL,NULL,6),(828,'Gercivan dos Santos Silva\r\n14:51 (50 minutos atrás)\r\n\r\nConseguir agendar a instalação do Link de Internet para amanha no horário comercial, passei o seu contato e do Danilo para o acompanhamento da instalação.',23,1,5,3,'2013-07-23 18:42:21','2013-08-01 12:59:00',0,NULL,'','[Instalação] Link ADSL SBLJ',47,'',0,'Info',NULL,'',NULL,NULL,1),(829,'Com intuito de librar o rack antigo para enviarmos para BV, os servidores rjserver3 e rjsrvesx247 serão migrados para o rack da Dell. \r\n\r\nEssa atividade será executada das 17hs às 19hs.\r\n\r\nOBS: hostmonitor indisponível durante 30min',7,1,5,3,'2013-07-23 19:18:52','2013-07-29 17:25:09',0,NULL,'','[Migração servidor para rack Dell]',47,'',0,'Mudança',NULL,'',NULL,NULL,3),(830,'Colocar no script de logon o novo IP do servidor de inventário',8,1,5,1,'2013-07-23 19:20:13','2013-07-29 17:25:16',0,NULL,'','[Alteração script de logon]',47,'',0,'Mudança',NULL,'',NULL,NULL,3),(831,'Hoje, dia 23/07/2013, ocorrerá uma manutenção no firewall da Cielo entre 22h00 até 00h00. Consequentemente, poderá ocorrer indisponibilidade na VPN durante esse intervalo.\r\n ',6,1,5,11,'2013-07-23 19:21:25','2013-08-01 12:58:20',0,NULL,'','[Manutenção FW da Cielo]',47,'',1,'Info',NULL,'',NULL,NULL,3),(832,'Realizando verificação junto a Operadora.\r\n\r\nIncidente afetou o pop que abastece o sinal da BRQ.\r\n\r\nNo período da manhã o telefone do Mega telecom também ficou impactado.\r\n\r\nFeedback operadora: indisponibilidade durou entre 25 - 30 min.',23,1,5,6,'2013-07-24 18:08:25','2013-08-05 15:18:04',0,NULL,'','Degradação Internet Alphaville',7,'48318 ',1,'Incidente',NULL,'',NULL,NULL,6),(833,'Aberto o chamado junto a mantenedora, aguardando retorno da operadora.\r\n\r\nA GVT informou que fez uma manutenção e gostaríamos de confirmar se esta ok.\r\n\r\nDe qualquer forma a GVT ficara monitorando até amanhã de manhã para certificar possíveis quedas.\r\n\r\nSolicitante : Rafael Almeida',23,1,5,9,'2013-07-24 18:14:39','2013-08-05 15:18:55',0,NULL,'','Falha no tronco PP - (11) 3127-0300',5,'16465 876849201307241540',1,'Incidente',NULL,'',NULL,NULL,5),(834,'Aberto chamado junto a operadora para verificação. Nenhum impacto para operação.\r\nAinda não foi identificada nenhuma anormalidade pela operadora.\r\n\r\nAnalista Gercivan estará realizando o reset no roteador hoje as 21:00h.\r\n\r\nProcedimento realizado normalizando os equipamentos.',23,7,4,2,'2013-07-29 13:34:03','2013-08-12 12:33:52',0,NULL,'','Link CITI Contingência.',2,'213874116 213964846',1,'Incidente',NULL,'',NULL,NULL,1),(835,' Estamos enfrentando forte lentidão, alternada por breves indisponibilidades. Em contato com a GVT fomos informados que o problema afeta toda a região Nordeste. Não existe prazo para normalização dos serviços e o problema foi constado hoje (31/07) as 8:30hrs.\r\n\r\nSegue protocolo 884917201307311025.',23,1,5,10,'2013-07-31 15:11:04','2013-08-09 17:37:16',0,NULL,'','Lentidão Internet (GVT - Recife, Salavador e Natal)',4,'884917201307311025',1,'Incidente',NULL,'',NULL,NULL,1),(836,'Será criada uma VPN Ipsec com a GVT no site de Kennedy.\r\n\r\nTalvez tenhamos alguns timeouts na rede de kennedy devido a aplicação das regras de firewall. A janela para esta ativação é das 22h as 23h.',4,1,4,7,'2013-07-31 21:25:29','2013-08-02 21:14:28',0,NULL,'','Ativação VPN com GVT',4,'',0,'Mudança',NULL,'VPN foi criada porém não entrou em funcionamento pois deu erro na Fase 2 no equipamento da GVT.\r\n\r\nNovos testes previstos para 01/08 a partir das 22hs.',NULL,NULL,3),(837,'Direcionado o trafego do GMAIL (utilizado por este link) para o link da Algar.\r\n\r\n08:30hrs: Falha no Backbone da operadora afetando todos os cliente de SP/RJ.\r\n\r\n14:30hrs: Falha continua, equipe atuando em manutenção, porém sem previsão de retorno.\r\n\r\n18:20hrs: Reparo realizado as 15:00h referente a uma falha massiva que impactou toda região de SP.',23,1,5,5,'2013-08-01 11:20:24','2013-08-12 12:31:26',0,NULL,'','[ Indisponivel] Link internet GVT BV',4,'886641201308010831 887767201308011413 888697201308011822',1,'Incidente',NULL,'',NULL,NULL,6),(838,'Ativação do Acc de wan em VO\r\n\r\nHorário: 20hs\r\n\r\nImpacto: oscilação na MPLS da localidade',1,1,5,2,'2013-08-01 20:24:00','2013