arão indisponíveis durante 15min',1,1,5,2,'2013-08-06 18:41:17','2013-08-08 17:57:49',0,NULL,'','[Alteração IP Media Gateway]',5,'',0,'Mudança',NULL,'Pela manhã, a localidade ficou impossibilitada de realizar ligações.\r\n\r\nSegue explicação da Instant:\r\n\r\nUma parte da configuração do direcionamento das chamadas saintes do media gateway de vila olimpia acabou se perdendo ao reinicia-lo na parte da manhã, fazendo com que o encaminhamento para a operadora chegasse incorreto, isso não interferiu nas chamadas entrantes e nem nas chamadas dos outros sites informados nesse ticket.\r\nFoi recadastra a regra perdida, salva no gateway e validada após o restart realizado por nós.\r\n\r\nAs rotas já foram revertidas para a original conforme o Renato informou no nosso último comentário.\r\n',NULL,NULL,3),(846,'Hoje, das 19hs às 20hs, as máquinas citadas acima serão migradas para o mini-dc.',1,1,5,2,'2013-08-06 18:43:51','2013-08-09 14:08:54',0,NULL,'','[Migração FW/Squid e Vilaserver1]',47,'',0,'Mudança',NULL,'Após vários problemas para leva-lo para o Mini DC ele foi todo refeito com um Linux \"do zero\" e os arquivos de configuração foram trazidos do que estava no ar.',NULL,NULL,6),(847,'Hoje, de 18:30hs às 19hs, será realizada uma manutenção no fw/squid de BSB para liberação de espaço.',30,1,5,12,'2013-08-06 18:46:17','2013-08-08 17:55:22',0,NULL,'http://jira.brq.com/browse/INFR-3172','[Manutenção FW/SQUID]',47,'',0,'Mudança',NULL,'',NULL,NULL,3),(848,'Segue abaixo as alterações no script de logon:\r\n\r\n1 - Alterar Script de logon para as novas redes de Vargas e Vila \r\n2 - Alterar Script de logon para mapear o diretório 43DP no ambiente citrix \r\n3 - Alterar Script de logon para o ip do servidor do Xact',8,1,5,1,'2013-08-06 18:47:24','2013-08-08 17:51:41',0,NULL,'','[Alteração script de logon]',47,'',0,'Mudança',NULL,'',NULL,NULL,3),(849,'Será realizada a configuração de DHCP no squidcwb para atribuir IPs para as máquinas de contingência do HSBC\r\n\r\nExecutores: L