 Ricardo Dos Santos Leão Junior que o ambiente neste instante esta estável.Porém tivemos uma instabilidade com duração de 10 minutos no período da tarde \r\n\r\n23/08/2013 - 10:00 - verificado com  Ricardo Dos Santos Leão Junior que o ambiente neste instante esta estável. Faremos uma nova verificação na parte da tarde para validar o ambiente. \r\n\r\n23/08/2013 - 15:20 - verificado com  Ricardo Dos Santos Leão Junior que o ambiente neste instante esta estável. O ambiente continua em monitoração.\r\n\r\n26/08/2013 - 13:48 - Aberto chamado 260820137658980 para verificar as indisponibilidades. \r\n\r\n26/08/2013 - 14:45 - Efetuado o escalonamento para a gestora Cintia a fim de verificar as falhas.\r\n\r\n27/08/2013 - 16:00 - verificado com Glauber Silva que o ambiente neste instante esta estável. O ambiente continua em monitoração.\r\n\r\n28/08/2013 - 12:00 - verificado com Glauber Silva que o ambiente neste instante esta estável.O ambiente continua em monitoração.',23,12,5,14,'2013-08-21 18:47:57','2013-08-30 13:42:58',0,NULL,'','[Indisponibilidade] link GVT Natal - RN ',4,'260820137658980',1,'Info',NULL,'',NULL,NULL,5),(886,'Hoje, serão desligados os servidores Domino, NOTESNG/Websp e DOMINOSP1/Websp.\r\n\r\nCaso algum usuário reclame que o Notes parou de funcionar, é por que ele não tem o documento de conexão para os outros servidores.\r\nApenas criem um documento de conexão para o Moebius usando o nome internet dele \"moebius.brq.com\".\r\nPara isso, apertem \"Ctrl + O\" no campo \"Look in\" coloquem \"moebius.brq.com\" e de enter.\r\nNão deve ser necessário, mas encontrem o caminho da base que ele precisa usar.',2,1,5,1,'2013-08-21 21:06:49','2013-08-28 19:06:24',0,NULL,'','[Desligamento dos servidores Lotus Domino]',47,'',0,'Mudança',NULL,'',NULL,NULL,3),(887,'Será feito ativação da MPLS Murano.',2,1,5,11,'2013-08-22 19:50:28','2013-08-26 13:50:40',0,NULL,'','Ativação link MPLS MURANO',23,'',0,'Mudança',NULL,'.',NULL,NULL,3),(888,'Mensagem de erro: We\'re sorry...\r\n... but your computer or network may be sending automated queries. To protect our users, we can\'t process your request right now.\r\n\r\n27/08/2013 - 08:00 - Google direcionado para o link GVT e as pesquisas estão funcionando normalmente.\r\n\r\n27/08/2013 - 15:00 - Analista Google continua buscando maiores informações relacionadas também aos dispositivos Móveis, não descartamos que o problema possa estar com a nossa operadora GVT. Seguimos no momento com o Link \r\nLevel(3).\r\n\r\n30/08/2013 - 10:00 - Conforme informado pelo Analista Alexandre Cabrera o problema tornou a acontecer tanto no link da GVT quanto no da Level 3.Continua em monitoração.\r\n\r\n04/09/2013 - Conforme identificado pelo analista Alexandre Cabrera a maquina da recepção de Vila Olimpia estava afetando com malwares a pesquisa do google na Localidade. \r\n\r\n12/09/2013 - Foi identificado que o problema estava no equipamento com malware.',23,1,5,2,'2013-08-26 13:34:40','2013-09-12 19:58:34',0,NULL,'','[Mensagem de erro] Bloqueio de pesquisa no Google',4,'',0,'Info',NULL,'',NULL,NULL,6),(889,'Chamado aberto junto a operadora: l21062;\r\nProblema identificado com o roteador Level(3), o mesmo pode estar desligado.\r\n\r\n27/08/2013 - 15:50 - Informamos que a indisponibilidade foi causada devido a uma falha no equipamento (roteador) da operadora, estamos negociando a troca do mesmo, para que sejam evitados incidentes futuros.A contingência foi desativada as 09:00 horas, o link continua em monitoração.\r\n',23,1,5,9,'2013-08-27 11:11:34','2013-08-30 13:44:27',0,NULL,'','[Link MPL Panamérica Park] Indisponível.',23,'6946828',1,'Incidente',NULL,'Prezado cliente,\r\n\r\nConforme solicitação via telefone pelo cliente Sr. Gercivan, encaminhamos ao time de Assurance a solicitação para verificação do Roteador no cliente pois,\r\no mesmo vem apresentando falhas de energia intermitentes.\r\nTão logo qualquer atualização seja disponibilizada lhe informaremos prontamente.',NULL,NULL,3),(890,'Problemas de indisponibilidade com o link ponto a ponto, verificando junto a operadora.\r\n\r\nLan to Lan Vila Olímpia x Bradesco, incidente ocorreu as 02:30 h, tendo a sua normalização as 07:50h, o procedimento realizado foi um restart realizado remotamente pela Level(3) na porta 0/10 do Switch na ponta da Bradesco. \r\nRealizada as devidas verificações de tráfego e o link voltou a operar em sua normalidade.\r\nFoi aberto um ticket para monitoração deste link durante o dia 6946885. (Monitorando).\r\n\r\n27/08/2013 - 16:00 - Não tivemos mais instabilidade neste link. Permaneceremos em monitoração.',23,2,5,2,'2013-08-27 11:13:32','2013-08-30 13:44:54',0,NULL,'','Link ponto a ponto VO x Bradesco',23,'6946885',1,'Incidente',NULL,'',NULL,NULL,6),(891,'28/08/2013 - Foi verificada falha massiva na MPLS de Fortaleza \r\nAberto o chamado n° 6951300 as 10:42h. Prazo de retorno 4 horas\r\n28/08/2013 - Foi ativada a contingência. \r\n28/08/2013 - Conforme informações da operadora a previsão para recuperação do link esta prevista para as 17:00 horas de hoje.\r\n\r\n29/08/2013 - Efetuada a manutenção do link pela operadora. Aguardando testes dos técnicos para validar o ambiente.\r\n\r\n29/08/2013 - Testes efetuados com sucesso, a MPLS de Fortaleza encontra-se operacional.',23,1,5,8,'2013-08-28 14:06:00','2013-09-03 21:16:56',0,NULL,'','[Hostmonitor] C.FORMPLSROUTER.LAN0',23,'6951300',1,'Incidente',NULL,'28/08/2013 - A interrupção de serviço observada está relacionada a uma falha massiva entre Juquitiba e Juquiá (BB # 6951343).\r\n\r\n28/08/2013 - Estamos passando por uma queda geral de energia na região nordeste. As localidades de Fortaleza e Recife estão operando por contingência \"Nobreak\" e Natal encontra-se inoperante. \r\nNoticia da imprensa - http://g1.globo.com/pernambuco/noticia/2013/08/chesf-confirma-queda-de-energia-no-nordeste.html\r\n',NULL,NULL,5),(892,'28/08/2013 - Estamos passando por uma queda geral de energia na região nordeste. As localidades de Fortaleza e Recife estão operando por contingência \"Nobreak\" e Natal encontra-se inoperante. \r\nNoticia da imprensa - http://g1.globo.com/pernambuco/noticia/2013/08/chesf-confirma-queda-de-energia-no-nordeste.html\r\n28/08/2013 - 17:30 - Energia restabelecida em Fortaleza\r\n28/08/2013 - 17:00 - Energia restabelecida em Recife\r\n29/08/2013 - 09:00 - Energia restabelecida em Natal \r\n\r\n29/08/2013 - Todas as localidades do Nordeste operando normalmente.',23,12,5,1,'2013-08-28 18:50:46','2013-08-30 13:48:09',0,NULL,'','[Incidente]Falha massiva na energia na região do Nordeste',47,'',1,'Incidente',NULL,'',NULL,NULL,6),(893,'28/08/2013 - Estamos com o link de internet indisponível no site de Vargas.\r\n28/08/2013 - Foi acionada a contingência. \r\n28/08/2013 - Informamos que a internet da localidade Vargas voltou a operar em sua normalidade as 18:00h. O problema foi identificado no roteador da operadora, sendo necessária a troca do mesmo.\r\n29/08/2013 - A internet funciona normalmente na localidade Vargas.\r\n',23,1,5,3,'2013-08-28 19:11:17','2013-08-30 13:48:48',0,NULL,'','[Internet Vargas] Atuando pela Contingência.',9,'1308281616194804 ',1,'Incidente',NULL,'Informamos que a internet da localidade Vargas voltou a operar em sua normalidade as 18:00h. O problema foi identificado no roteador da operadora, sendo necessária a troca do mesmo..\r\n\r\nContinuaremos monitorando o link.\r\n\r\n-----------------------\r\n\r\nEstamos passando por uma indisponibilidade no link de internet dedicado da Mundivox,  na localidade Vargas. As rotas de internet foram alteradas para o link GC Level (3) como contingência. Estamos em contato junto a operadora, está sendo direcionado um Técnico para analisar todos os equipamentos com o prazo de duas horas, podendo ser antecipado.\r\nPrecisamos agendar uma janela de mudança, para que sejam realizados novos testes relacionados ao desvio de rotas automático no HostMonitor, hoje o processo foi realizado manualmente.\r\nAlerta criado em nossa console para acompanham