ponsável BRQ esta no Local junto a área técnica da operadora. Estamos sem previsão de retorno.\r\n\r\nO site continua atuando pela contingência.\r\n\r\nInformamos que o serviço de MPLS na localidades BRQ Panamérica Park está restabelecido\r\ne o Site opera em sua normalidade.\r\n',23,4,5,9,'2013-09-25 17:42:28','2013-10-10 18:41:53',0,NULL,'','[Indisponibilidade] link MPLS - PP',23,'7042585 ',1,'Incidente',NULL,'Realizamos mais um contato junto a GC Level (3), o chamado está escalonado junto a diretoria de assurance, continuamos sem nenhuma informação em relação ao incidente.\r\n\r\nEm relação a contingência, precisamos realizar uma verificação em relação a conectividade do Site PP com as outras localidades.\r\nForam realizados alguns testes de Ping junto ao analista Jackson para o site de BV e Vargas sem sucesso, devido a este processo a localidade não está conseguindo utilizar o serviço de impressão.\r\n\r\nContinuaremos cobrando a solução junto a operadora.',214,NULL,6),(954,'Equipe Google: \r\n25/09/13 17:20\r\nEstamos investigando relatos de um problema com o Gmail. Forneceremos mais informações em breve.\r\n	\r\n25/09/13 17:40\r\nNossa equipe ainda está investigando o problema. Forneceremos uma atualização até 25/09/13 18:40 com mais informações. Obrigado por sua paciência.\r\nHá um texto adicional disponível em inglês. Visite a página em inglês para ver o texto adicional em inglês.\r\n\r\n25/09/13 18:09\r\nO problema com o Gmail deverá ser resolvido. Pedimos desculpas pelo transtorno e agradecemos a sua paciência e o seu apoio.\r\n\r\n25/09/13 18:09\r\nO problema com o Gmail deverá ser resolvido. Pedimos desculpas pelo transtorno e agradecemos a sua paciência e o seu apoio.',23,1,5,1,'2013-09-25 20:57:43','2013-09-27 12:35:37',0,NULL,'','[Instabilidade] Google Mail.',30,'',1,'Mudança',NULL,'',NULL,NULL,5),(955,'A operadora GVT está com uma falha massiva na região de Recife desde as 08:00hrs , impactando todos os links de voz. Foi aberto o chamado 963905201309