te voltou a operar em sua normalidade.\r\n',23,21,5,12,'2013-10-10 13:31:08','2013-10-15 19:26:14',0,NULL,'','[Indisponibilidade]Link MPLS GVT - BSB',4,'987366201310101006',1,'Incidente',NULL,'10/10/2013-13:29 - Houve um rompimento de fibra na região de Brasilia e a operadora esta localizando o ponto para realizar a fusão. \r\nAinda sem previsão. \r\n\r\n',598,NULL,6),(979,'O FWBV será substituído hoje, das 20:30hs às 21hs devido aos problemas que vem ocorrendo na localidade desde a última segunda feira.\r\n\r\n',1,1,3,5,'2013-10-10 20:54:44','2013-10-14 20:21:24',0,NULL,'http://jira.brq.com/browse/INFR-3261','[Substituição do FW]',47,'',0,'Mudança',NULL,'Após a troca do FW, o problema em relação a IP foi resolvido.\r\n\r\nPorém algumas instabilidades começaram a ser apresentadas.',638,NULL,4),(980,'Hoje, às 23hs, serão adicionadas regras de firewall para ajuste e liberação do hangout em vargas.\r\n\r\nResumo da regra: \r\n\r\n$IPTABLES -t nat -I POSTROUTING -s 10.2.0.0/16 -p udp -d 74.125.0.0/16 --dport 19300:19309 -o eth0.45 -j MASQUERADE \r\n$IPTABLES -t nat -I POSTROUTING -s 10.2.0.0/16 -p tcp -d 74.125.0.0/16 --dport 19300:19309 -o eth0.45 -j MASQUERADE ',8,1,5,3,'2013-10-10 21:02:33','2013-10-14 20:21:29',0,NULL,'','[Adição de regras]',47,'',0,'Mudança',NULL,'',366,NULL,3),(981,'Substituição do Firewall de Boa Vista',1,1,1,1,'2013-10-11 01:56:03','2013-10-14 20:21:13',0,NULL,'','[FIREWALL BV]',47,'',0,'Mudança',NULL,'O Firewall de BV foi substituido por uma nova VM',NULL,NULL,3),(982,'Estamos passando por uma falha massiva na operadora level(3) a nível Internacional na Rede MPLS impactando a comunicação entre as localidades da BRQ.\r\n\r\nA equipe responsável já esta ativando a contingência. \r\n\r\n19:00- Link MPLS normalizado, operadora monitorou o mesmo a 1 hora e não foram encontrados erros.\r\nAs VPNS de contingência serão desativadas em uma janela. \r\n',23,1,5,1,'2013-10-11 17:56:47','2013-10-22 17:22:13',0,NULL,'','[Falha massiva] Rede MPLS BRQ',23,'',1,'Incidente',NULL,'Summary\r\n\r\nA memory issue was impacting IP services in Multiple Markets in Argentina and Brazil. \r\n\r\nEvent Case ID: 7101613\r\nLocation: Buenos Aires, Argentina\r\nETR: Service Restored \r\nBridge: N/A\r\nUpdates\r\n\r\n\r\n22:36 GMT - The IP NOC reports that, during a configuration change, a router prefix list was left unpopulated, causing a large routing table to be imported into a virtual private network (VPN) virtual route forwarding (VRF) table, propagating to multiple routers in Argentina and Brazil. The routers were unable to retain the large number of routes, resulting in memory allocation issues and causing the associated card and routers to fail. The IP NOC coordinated with the Latin America NOC to reload the routers and cards to restore services. During this process, some hardware failures also occurred, and the IP NOC groomed the associated circuits to resolve the failures as they arose. Since Saturday, October 12th at 6GMT all services are restored and stable.\r\n\r\n21:46 GMT - The IP NOC has been unable to provide an update on this issue. No new information is currently available, but updates will be provided as they are received.\r\n\r\n20:49 GMT - The IP NOC and the Latin America NOC are coordinating troubleshooting actions, and some services have begun to restore. Efforts are ongoing to restore all routers impacted by this issue.\r\n\r\n19:44 GMT - The IP NOC reports that the routers were reloaded to stabilize them. However, the IP NOC reports that hardware failures are now seen to be impacting the routers. Investigations are continuing in an effort to restore services. No estimated restoral time is currently available.\r\n\r\n18:50 GMT - The IP NOC and Latin America NOC continue to investigate the issue. No new information is currently available, but updates will be provided as they are received.\r\n\r\n18:20 GMT - The IP NOC reports that the suspected software memory issue is impacting multiple routers in Multiple Markets throughout Argentina and Brazil. The IP NOC and Latin America NOC are investigating the issue at this time.\r\n\r\n18:04 GMT - The Latin America NOC reports that a router is failing in Buenos Aires, Argentina impacting IP services. The router is experiencing a software memory issue that is disabling it. Investigations into the root cause of the issue are underway.\r\n\r\n\r\nEvent Management Team\r\nLevel 3 Communications, LLC\r\n720-888-4500\r\nDL-CSM Event Communications\r\nNote: The information contained in this communication is confidential to Level 3 and should not be distributed externally.',45,NULL,5),(983,'Neste sábado, 11/10, de 07 às 19, o DC do PP será desligado para a instalação do no-break.',1,1,3,9,'2013-10-11 20:36:04','2013-10-14 20:22:01',0,NULL,'','[Manutenção eletrica]',47,'',0,'Info',NULL,'No-break instalado com sucesso.',70,NULL,3),(984,'Realizado contato junto a operadora para análise do Link MPLS.\r\n\r\nO Site está operando via contingência.\r\n\r\nO Site voltou a operar em sua normalidade as 13:30h. Até o presente momento a operadora não identificou nenhum log de falha, continuaremos interagindo junto a mesma em busca da descrição da solução.',23,1,5,12,'2013-10-14 14:24:44','2013-10-15 19:27:21',0,NULL,'','Link MPLS GVT - BRQ',4,'992400201310141126',1,'Incidente',NULL,'',598,NULL,5),(985,'Informamos que a operadora estará realizando uma manutenção programada no Link Copel responsável pelo fornecimento\r\nao cliente HSBC – CWB.\r\nData 20/10/2013 – Domingo.\r\n\r\nInício da atividade: 09:00h\r\nFim da atividade: 17:00h\r\n\r\nTempo aproximado de indisponibilidade do Link: 6:00h.\r\n\r\nDurante este período os acessos não sofreram impactado, os mesmos estarão atuando via contingência.\r\n\r\nCerto de sua compreensão e cooperação.\r\nAtenciosamente,\r\nNOC - Network Operation Center\r\nInfraestrutura',23,3,5,4,'2013-10-16 14:38:28','2013-10-16 14:40:10',0,NULL,'','Manutenção programada Link Copel HSBC - CWB, 20/10/2013.',57,'1306 ',1,'Info