O                                                            __  \r\n  \r\nDevido à mudança do horário de verão que ocorrerá neste domingo, 20/10, é possível que o\r\nseu aparelho telefônico não atualize a hora corretamente. Caso isto ocorra, realize o\r\nprocedimento abaixo: \r\n\r\n• desconecte o telefone da rede elétrica; \r\n• aguarde 5 segundos; \r\n• conecte novamente. \r\n\r\nEm caso de problemas ou dúvidas, entre em contato com o Service Desk no ramal\r\n21 9898 ou pelo e-mail telefonia@brq.com\r\n\r\nAtenciosamente, \r\n\r\nJosé Magno \r\nInfraestrutura',1,1,3,5,'2013-10-20 10:38:42','2013-10-23 13:07:38',0,NULL,'','PARADA DC BV - 08 AS 18HRS (20/17) - MANUTENÇÃO ELETROPAULO',47,'',0,'Info',NULL,'',NULL,NULL,3),(994,'Estamos com instabilidade no Gmail, na pagina de Status do Google Apps ainda não temos informações, estamos acompanhando junto a Google o incidente.\r\n\r\nGoogle: 3/10/13 13:34\r\nO problema com o Gmail deverá ser resolvido. Pedimos desculpas pelo transtorno e agradecemos a sua paciência e o seu apoio. Tenha certeza de que a confiabilidade do sistema é uma prioridade para o Google, e estamos fazendo aprimoramentos contínuos para tornar os nossos sistemas melhores.\r\nHá um texto adicional disponível em inglês. Visite a página em inglês para ver o texto adicional em inglês.',23,1,3,1,'2013-10-23 14:30:11','2013-10-25 12:19:16',0,NULL,'','Instabilidade Google Mail.',30,'',0,'Incidente',NULL,'',NULL,NULL,5),(995,'Edson atualizando o versão do ESX do BVSRVESX252',17,1,5,6,'2013-10-23 19:59:30','2013-10-25 12:03:05',0,NULL,'','Atualização do ESX252.BV',47,'',0,'Mudança',NULL,'',NULL,NULL,3),(996,'Estamos recebendo alertas em relação ao Firewall de Boa VIsta, não está sendo possível pingar o mesmo.\r\n\r\nTelefonia,\r\n\r\nIdentificado no Check_LIst de Telefonia troncos indisponíveis:\r\n\r\nFOR - 085-3311- 9800\r\nVO - 011-2126-7000	\r\nBV - 011-2526-0600	\r\nPP - 011-3127-0300	\r\nALPHA - 011-3927-0600		\r\nBRA - 061-3029-9100\r\nKEN - 041-3593-52