   FTP do cliente Itaú\r\n\r\n·         Ambiente BRQ BSB \r\n\r\n\r\nA operadora realizou  a troca do router GVT no site BRQ Marechal normalizando os ambientes  \r\n( Marechal, Kennedy e Brasilia )\r\n\r\nInicio: 05/11/2013 – 14h40min\r\nTérmino: 05/11/2013 – 19h00min\r\n\r\nEstamos interagindo com a mesma para obter o relatório técnico sobre o ocorrido. \r\n',23,3,1,4,'2013-11-05 17:06:52','2013-11-07 12:19:13',0,NULL,'','[Indisponibilidade]MPLS Marechal',4,'028535201311051513',1,'Incidente',NULL,'Pendente: Solicitar relatório.\r\nInternet Brasília.',590,'',5),(1020,'Hoje, as seguintes maquinas serão migradas para nova rede de produção de Boa Vista.\r\n\r\nIAMIDO, Moebius, sametime, DNS1,DNS2 e Iamido',2,1,3,5,'2013-11-05 19:36:15','2013-11-07 18:38:31',0,NULL,'http://jira.brq.com/browse/INFR-3298','[Migração de maquinas DMZ]',47,'',0,'Mudança',NULL,'',NULL,'',3),(1021,'Conforme orientação da SAS Matriz, este tipo de atividade somente poderá ser realizado a partir das 18:00h.\r\nDessa forma, estamos reagendando para o dia 07/11/13-18H, a mudança de endereço para Rua Teofilo Otoni, 63 – 2 andar.\r\nInformo que o mantenedor do seu roteador deverá estar presente na data acima.\r\n\r\nIvi bom dia,\r\nEstamos reagendando a mudança do circuito da BRQ para o dia 07/11/13-18h\r\n\r\nsds\r\n==================================\r\nPéricles Marinho\r\nTel: (21) 2121-9501 / Cel: (21)9197-5606\r\nFax: (21)2121-3145\r\nGerência de Solução e Entrega R.J.\r\nDiretoria Embratel RJ\r\nDiretoria Executiva LENESUL\r\n\r\n11-11-2013 - Ativação efetuada com sucesso por volta das 21:00\r\n\r\n12-11-2013 - Efetuada organização dos cabos pelo DC \r\n\r\n12-11-2013 - Link funcionando normalmente. ',23,13,5,3,'2013-11-06 13:10:21','2013-11-13 17:07:11',0,NULL,'','Link Lan to Lan Embratel sas',2,'',0,'Info',NULL,'',1036,'',3),(1022,'Prezados,\r\n\r\nIdentificamos onde realizar as correções em relação ao SMTP. Acessando as configurações do PCC Equitrac pelo browser, as impressoras de Teófilo estavam com o endereço ip smtp antigo, as demais localidades estão corretas pelo server.\r\nCaso exista alguma localidade com problemas na função scan to me, favor desligar e ligar a impressora.\r\n\r\nAgradeço a todos os envolvidos.\r\n\r\n\r\n\r\nFunção scanner não está operando. Verificando junto as áreas responsáveis as alterações que ocorreram no ambiente. \r\n\r\naberto o chamado junto a operadora.',23,1,4,1,'2013-11-06 14:50:50','2013-11-09 15:23:18',0,NULL,'','[Scan to Me - Scanner]',47,'',0,'Incidente',NULL,'Marcos,\r\n\r\nBoa Tarde,\r\n\r\nConforme conversamos, estamos com problemas em relação a função Scan To Me na localidade do Rio de Janeiro ( Rua Teófilo Otoni n° 63), entrei em contato pelo 0800, recebi o primeiro atendimento, depois não obtive mais respostas.\r\nNão possuo número de chamado, devido a uma falha na ferramenta no momento que encontramos em contato.\r\n\r\nMensagem de Erro: java.net.No routeToHostException: No route to host;\r\n\r\nNecessito desse retorno o mais breve possível, o nosso servidor smtp está operacional.\r\nEm paralelo estamos realizando todas as verificações de rede em nosso ambiente.\r\n\r\nFavor priorizar o contato pelo meu celular (21) 8094-3100, se possível a visita de um técnico amanhã no primeiro horário, que esteja ciente do nosso processo Equitrac - Scan To Me.\r\n',NULL,'',5),(1023,'Identificamos uma lentidão no link MPLS do site BRQ BSB.\r\nEstamos atuando junto a área responsável para verificar o incidente. \r\nSegundo a GVT não temos problemas com o link, continuaremos monitorando junto a equipe responsável. \r\n\r\n07/11/2013 - verificado com o analista mgondim que no momento a situação esta normal, porém não pode ser validada por completo pois os colaboradores ainda não estão em sua totalidade no site. Faremos uma nova validação no final do dia. \r\n\r\n08/11/2013 - Validado com o analista mgondim que o ambiente BSB esta normalizado. ',23,21,5,12,'2013-11-06 18:24:26','2013-11-11 12:20:24',0,NULL,'','[Lentidão] Link MPLS BRQ BSB',4,'030892201311061614',0,'Incidente',NULL,'Boa tarde,\r\n \r\n                Sr. Aroldo conforme solicitado segue testes de ping entre BSAxCTA, não identificamos falha no circuito.\r\n \r\nBRQ_BSA-301FYGLMF#ping 172.41.0.2 source gigabitEthernet 0/1 rep 1000\r\n \r\nType escape sequence to abort.\r\nSending 1000, 100-byte ICMP Echos to 172.41.0.2, timeout is 2 seconds:\r\nPacket sent with a source address of 10.2.224.252\r\n\r\nSuccess rate is 99 percent (999/1000), round-trip min/avg/max = 32/35/96 ms',598,'mgondim',5),(1024,'Hoje, de 18:30 às 19:30, a telefonia de Marechal será migrada para Voip.\r\n\r\nPlanejamento da mudança, segue no jira anexado.',20,1,3,4,'2013-11-06 19:05:08','2013-11-11 12:02:12',0,NULL,'http://jira.brq.com/browse/INFR-3299','[Migração Voip Marechal]',5,'',0,'Mudança',NULL,'',NULL,'',3),(1025,'Hoje, às 21hs, todas as URAs de atendimento (415505, 219898, 419898 e 218870)serão migradas para SP.\r\n',20,1,3,1,'2013-11-06 19:08:07','2013-11-11 12:02:01',0,NULL,'https://docs.google.com/a/brq.com/document/d/12kmg89EAds8SCC-a_K9W-M27dLLn6jEzOtMqLD3GIDQ/edit','[Migração DAC RJ -->SP]',5,'',0,'Mudança',NULL,'',NULL,'',3),(1026,'houve um travamento no cascateamento dos switchs ocasionando a indisponibilidade. \r\n\r\nFoi efetuada uma manobra pela operadora que uniu todos os serviços em um único equipamento, deixando o ambiente operacional. \r\n\r\nContinuaremos interagindo junto a operadora para solucionar o ocorrido. \r\n\r\n',23,25,5,3,'2013-11-07 17:14:21','2013-11-12 13:46:30',0,NULL,'','[Indisponibilidade] Switch Petrobras',47,'',0,'Mudança',NULL,'',NULL,'',6),(1027,'A Algar Telecom comunica que devido à realização de manutenção em nossa rede e para garantia da qualidade dos serviços prestados, o serviço de sua empresa poderá sofrer indisponibilidade temporária dentro da janela de manutenção abaixo.\r\n \r\nDATA: 09/11/2013 \r\nINÍCIO: 23h55\r\nFIM:  01h00 \r\nLOCALIDADE: São Paulo - SP\r\n\r\n\r\nINDISPONIBILIDADE: 00h05 (05 m