icações também se normalizasse.\r\n\r\nEstou entrando em contato com o suporte Citrix, para obter suporte com relação ao ocorrido.\r\n\r\n\r\nDuvidas a dispor.',78,'',5),(1080,'Hoje, 20hs às 20:30hs, o FWVila será migrado da R620 para ESX1950.\r\n\r\nUma vez que temos enfrentado diversos incidentes com a R620. ',1,1,3,2,'2013-11-26 19:09:35','2013-11-28 18:44:25',0,NULL,'','[Migração FW --> ESX1950]',47,'',0,'Mudança',NULL,'',179,'',3),(1081,'Hoje, de 19hs às 21hs, os switchs de BSB serão preparados para o funcionamento da internt, MPLS CEF, Link Algar \r\n',2,26,5,12,'2013-11-26 19:13:03','2013-11-28 11:47:00',0,NULL,'http://jiracorp.brq.com/browse/INFRA-1272','[Manutenção switch]',47,'',0,'Mudança',NULL,'',585,'',3),(1082,'O site da BRQ estará rodando fora da BRQ (IBM), para que isso funcione é necessário que os dns\'s do dominio brq.com e www.brq.com aponte para o endereço 75.126.184.234\r\n\r\nEssa atividade será executada hoje às 21hs.\r\n\r\nOBS:\r\n\r\nEm caso de problema pós mudança, como por exemplo, site fora do ar, erro de código. Favor entrar em contato com Thiago Paulino (R: 115283)',2,1,5,1,'2013-11-26 19:18:27','2013-11-28 18:44:31',0,NULL,'','[Alteração no DNS para site BRQ]',47,'',0,'Mudança',NULL,'',NULL,'',3),(1083,'Identificamos uma falha as 23:59 de 26/11/2013 na MPLS da BRQ Fortaleza, a contingência foi ativada. \r\n\r\nSem impactos no momento. \r\n\r\nEstamos interagindo junto a operadora. \r\n\r\n____________________________________________________________\r\n\r\nConforme informações da operadora estamos passando por uma falha massiva na região de Fortaleza, sem previsão de retorno. \r\n\r\n____________________________________________________________\r\n\r\nServiço MPLS do site BRQ Fortaleza normalizado após manutenção da operadora. ',23,15,5,8,'2013-11-27 10:39:29','2013-11-29 17:31:43',0,NULL,'','[instabilidade] MPLS FOR ',23,'7268982',1,'Incidente',NULL,'Chamado aberto proativamente pela operadora. \r\n\r\n_________________________________