-02 12:22:14',0,NULL,'','Marechal/Kennedy',47,'',0,'Mudança',NULL,'',NULL,'',6),(1093,'1                    Em função do projeto de revitalização da infraestrutura de rede da CAIXA, haverá a adequação da plataforma do firewall de desenvolvimento, inviabilizando toda a comunicação com origem e/ou destino ao ambiente de desenvolvimento, em principio, na janela de manutenção do dia 01/12/2013.\r\n \r\n2                    Desta forma haverá indisponibilidade do serviço de VPN e, consequentemente o acesso ao ambiente de desenvolvimento aos usuários das fábricas de softwares, durante o período entre 00:01h e 06:00h do dia 01/12/2013.\r\n \r\n3                    As seguintes empresas serão afetadas: BRQ, TTY, MSA, INDRA, BRICON, PEOPLEWARE, META, RSI, DBA e STEFANINI.\r\n \r\n4                    Solicitamos dar ciência as fábricas acerca desta manutenção e, verificar a possibilidade da realização de testes para a validação de acesso VPN, executados por profissionais destas empresas durante a janela de manutenção, entre 00:01h e 06:00h do dia 01/12/2013.\r\n \r\n4.1              Caso exista esta possibilidade, favor informar-nos até o dia 21/11/2013 (quinta-feira), juntamente com as informações de contato.\r\n \r\n5                    Durante a janela de manutenção, quaisquer dúvidas ou solicitações poderão ser realizadas através do telefone (61) 8101-6336 BIP da equipe de Rede.\r\n \r\n6                    Desde já agradecemos a colaboração e colocamo-nos disposição para esclarecimentos.\r\n\r\n** Esta manutenção será efetuada pelo Cliente CAIXA.\r\n\r\n02/12/2013 - 09:00 - Manutenção efetuada sem impactos, check list realizado no ambiente CEF com sucesso. \r\n',23,21,5,12,'2013-11-29 15:16:51','2013-12-03 10:38:48',0,NULL,'','[Manutenção] Ambiente CEF',47,'',1,'Info',NULL,'Check list realizado pelo analista mgondim. ',586,'',5),(1094,'29/11/2013 - 15:42 - Identificamos uma indisponibilidade inciada as 13:00 no ambiente de telefonia externa nos sites de Alphaville e Murano. Os ramais não efetuam e não recebem ligações. \r\n\r\nInternamente esta funcionando. \r\n\r\n\r\n29/11/2013 - 15:45 - Há uma falha massiva no backbone de Barueri.A equipe da operadora está atuando. \r\nEstamos interagindo junto a área responsável para solucionar o incidente. \r\n\r\n\r\n29/11/2013 - 22:00 - ambiente normalizado e validade pela equipe de telefonia. ',23,1,5,6,'2013-11-29 15:21:13','2013-12-03 10:37:46',0,NULL,'','[Indisponibilidade]Ambiente telefonia Alphaville e Murano',4,'064338201311291519',1,'Incidente',NULL,'',84,'',5),(1095,'Neste domingo, das 07hs às 13hs, será realizada uma manutenção dos switchs da BRQ Boa Vista.\r\n\r\nSegue abaixo os serviços que serão impactados durante a atividade:\r\n\r\n- Servidores de desenvolvimento e projetos;\r\n- Servidores de produção; (SAP, RM, Sisint, Jira)\r\n- Servidores de Arquivos; (Mapeamentos: R-ADM, P-Temp, Q-Projeto e etc) - exceto BRQ Marechal\r\ne BRQ Kennedy\r\n- Impressão\r\n- Site BRQ\r\n- I-AM-I-DO\r\n- Citrix\r\n- XACT\r\n',1,1,3,5,'2013-11-29 16:39:23','2013-11-29 21:26:21',0,NULL,'http://jiracorp.brq.com/browse/INFRA-1287','[Manutenção switch BV]',47,'',0,'Mudança',NULL,'Devido a demanda de projetos do cliente Redecard, manutenção teve que ser cancelada',NULL,'',2),(1096,'MPLS Indisponível, VPN Automática ativada. Duração de impacto 10min.\r\n\r\n15:30h - 15:40h\r\n',23,1,5,4,'2013-11-29 18:15:03','2013-12-02 16:35:47',0,NULL,'','Link MPLS Level3 - BRQ',23,'7276828',1,'Incidente',NULL,'',194,'',5),(1097,'Estamos com problema de conexão dos clients de antivírus com o servidor. (Reputation Service Reconnecting) Devido a isto estamos com lentidão na rede das localidades de Marechal e Kennedy\r\n\r\n29/11/2013 - 18:09 - problema foi corrigido, foi necessário reiniciar e criar o Web site do IIS.',24,1,5,4,'2013-11-29 18:22:30','2013-12-02 16:35:09',0,NULL,'','Lentidao Rede interna Marechal e Kennedy',37,'',0,'Incidente',NULL,'',NULL,'Flávio',6),(1098,'Os links novos com o HSBC foram ativados e os acessos validados. Os links antigos continuam ativos por um período de testes e contingência caso necessário.',4,1,5,4,'2013-12-01 12:15:16','2013-12-02 16:36:50',0,NULL,'http://jiracorp.brq.com/browse/INFRA-1265','Links novos HSBC ativados em Marechal e Kennedy',47,'',0,'Info',NULL,'',NULL,'',3),(1099,'Passamos por um incidente elétrico no dia 01/12/2013, sendo necessário religar os disjuntores do segundo andar. \r\n\r\nEstamos interagindo junto a área responsável para verificar o ocorrido.  ',23,1,5,3,'2013-12-02 12:34:11','2013-12-03 10:45:03',0,NULL,'','[Indisponibilidade] Ambiente site BRQ Teofilo',47,'',1,'Incidente',NULL,'O plantonista do service desk atuou na solução do incidente. ',64,'',5),(1100,'Foi identificada uma falha de energia elétrica no site BRQ Alphaville causada pelo nobreak. \r\n\r\nPeríodo do impacto - 01/12/2013 - 19:50hrs ás 02/12/2013 - 06:45hrs\r\n\r\nSerá realizada a troca do equipamento pelo condomínio prevista para o fina de semana 07/12/2013 - 08/12/2013\r\n\r\n07-12-2013 - 21:11 - Finalizada com sucesso a troca do no break, ambiente testado e validado. ',23,1,5,6,'2013-12-02 12:41:16','2013-12-09 15:02:12',0,NULL,'','[Manutenção] Ambiente site BRQ Alphaville ',47,'',1,'Info',NULL,'Empresarial Conti Chiari\r\n\r\n COMUNICADO \r\n\r\n nº 05/2013\r\n\r\nRef.: NO BREAK /02\r\n\r\nComunicamos à todos que em face ao últimos problemas ocorridos em \r\n\r\nfunção do nobreak do prédio, ja efetuamos a aquisição de um novo equipamento o qual \r\n\r\nestá com sua instalação prevista para o dia 07/12/13(sábado).\r\n\r\nPortanto, haverá necessidade de desligamento geral da cabine secundária à qual alimenta \r\n\r\no prédio, ficando o mesmo totalmente sem energia. \r\n\r\nEstamos prevendo que essa interrupção permanecerá das 8:00hs às 18:00hs, havendo \r\n\r\npossibilidade de se estender pelo período necessário para a finalização dos serviços com \r\n\r\nsegurança. (domingo ).\r\n\r\nPedimos desculpas pelos transtornos, mas trata-se de uma operação visando melhorias \r\n\r\nem benefício de todas as empresas.\r\n\r\nContamos com a compreensão de todos.\r\n\r\nEmpresarial Conti Chiari\r\n\r\nMárcio Cerqueira Cesar \r\n\r\nSíndico 02/12/2013\r\n\r\n____________________________________________________________\r\n\r\nBoa tarde, à todos(as.)\r\n \r\nTendo em vista que o nosso nobreak está inoperante, amanhã à noite, terça-feira, às 20:00hs, estaremos fazendo a reversão da alimentação dos quadros estabilizados.\r\nIsto quer dizer que até a finalização dos serviços no sábado, os mesmos estarão sendo alimentados diretamente pela Eletropaulo.\r\nSendo assim, recomendamos que cada empresa proteja seus servidores com nobreaks pequenos para a transição Eletropaulo/gerador/Eletropaulo em eventuais queda de energia.  \r\n \r\nAproveitamos para informar que essa manobra durará apenas alguns segundos.\r\n \r\nGrato,\r\n \r\n \r\n \r\n__________________________________________\r\nJoão Barroso\r\nSupervisor predial\r\nLazulli Corporate Office / Empl. Contichiari\r\n|  11 4196-3333 r 3379 | 11 9 8549-3473 | \r\n| jbarroso@ddcom.com.br | www.ddcom.com.br |\r\n\r\n___________________________________________________________\r\n\r\nO analista Elsson irá acompanhar a parada programada que ocorrerá hoje as 20:00hrs\r\n\r\n____________________________________________________________\r\n\r\n3/12/2013 - 21:07 - Efetuado o desligamento do DC, para a reversão de elétrica informada pelo condomínio.\r\n\r\nMaquinas restabelecidas, efetuado teste com telefonia interna e externa, sistemas internos, impressão, internet, mainframe com o cliente, ambos tudo ok.\r\n\r\nUma Observação, o disjuntor do lado esquerdo, após a queda da elétrica, desarmou, deixando todo lado esquerdo sem energia, entrei em contato com o funcionário Jose de Facilites que me explicou o procedimento para religarmos as maquinas.\r\n\r\n___________________________________________________________\r\n\r\n05\\12\\2013 - 01:33hrs -  Incidente elétrico em Alphaville que ocasionou o desligamento forçado dos servidores. \r\n\r\n____________________________________________________________\r\n\r\nAlém do DC, o disjuntor de entrada do quadro que alimenta as mesas do lado mais novo também desarmou. Na realidade toda vez que falta energia ou pisca a energia, ele também esta atuando/desarmando e já avariou o mesmo, tanto que estarei trocando o mesmo.\r\n\r\nAntes não sentíamos tanto o problema da falta ou piscada de energia, porque tinha o no break do prédio funcionando e desde que o mesmo parou de funcionar, percebi que a rede local é muito instável. Ainda bem que o no break estará sendo trocado esse final de semana e, com isso, deixaremos de ter esse problema.\r\n\r\n\r\n\r\n\r\n\r\n\r\nGrata,\r\n\r\nAndréia Flores Sousa\r\nBRQ IT Services – FACILITIES \r\nTel.: (11) 2126-5064\r\nCel.: (11) 983-114-123\r\n\r\n____________________________________________________________\r\n\r\n07-12-2013 - 21:11 - Foi finalizada por volta das 20:30 min, a parada eletrica relaizada no site  Alphaville, com a instalação do novo no-break, efetuado teste com o corte da da energia da rua, deixando somente o no-brak assumindo.\r\n\r\napós os teste ser realizado, foi religado do DC, efetuando teste locais como segue abaixo.\r\n\r\nTelefonia - ok\r\nInternet - ok\r\nImpressão  - ok\r\nAcesso wireless  - ok\r\nLinks dos clientes Bradesco e RedeCard  - ok\r\n',7,'',3),(1101,'02-12-2013 - 15:35 - Identificamos uma indisponibilidade no ambiente do cliente BTG no site BRQ de Vila Olímpia. \r\n\r\nEstamos interagindo junto a área responsável para verificar o ocorrido. \r\n\r\n03/12/2013 - 00:22 - Ambiente normalizado após manutenção no ambiente do cliente. ',23,18,5,2,'2013-12-02 17:59:17','2013-12-04 12:01:34',0,NULL,'','[Indisponibilidade]Ambiente BTG BRQ Vila Olimpia',23,'',1,'Incidente',NULL,'',904,'',5),(1102,'02/12/2013 - 18:10 - Site Marechal atuando via contingência. Serviço MPLS Down.\r\n\r\n\r\n02/12/2013 - 20:00 - Informamos que o serviço MPLS do site BRQ de Marecha