lha elétrica, tal atividade foi realizada pela equipe da AES Eletropaulo que também realizou o reparo no cabo danificado.\r\n \r\nOS Subprefeitura\r\nChamado SAC 11598812\r\nData: 06/06/2013\r\nOS Eletropaulo: 317335497',70,'',6),(1186,'07-01-2014 - 10:50 - Estamos com o servidor ppserver9 com 1% de espaço livre no disco C\r\n\r\n13-01-2014 - 11:40 - Efetuado o aumento do disco para 2GB.',23,21,4,9,'2014-01-07 13:27:17','2014-01-14 16:59:09',0,NULL,'','Espaço em disco',47,'',0,'Incidente',NULL,'Elsson Alves Dos Santos\r\n11:40 (23 horas atrás)\r\n\r\npara Network, Sergei, Alexandre, Jose, Fabio \r\nBom dia!\r\n\r\nAlinhei junto com a equipe DC SP e o Jose Ventura o aumento do disco em 2Gb, para não deixarmos correr o risco de travar o servidor por falta de espaço em disco.\r\n\r\n\r\nJose Conforme conversado, tem ficar alerta para não deixar a galera fazer novas copias para esse servidor, pois pode voltar a alarmar novamente, e assim que o Fabio retornar das ferias fale com ele a respeito para a possibilidade de aliviar o espaço do disco.\r\n\r\n\r\nNok,\r\npode agendar para a semana que vem, podermos cobrar uma posição do Fabio!\r\n',672,'',6),(1187,'07-01-2014 - 14:27 - Identificamos em nossa monitoração que o servidor SRV772 não esta respondendo na rede BRQ. \r\n\r\n07-01-2014 - 15:13 - Efetuada a troca do cabo de rede. Acesso validado pelo colaborador.',23,2,4,5,'2014-01-07 16:46:15','2014-01-09 11:07:01',0,NULL,'','Servidor - projeto RDZ-UT',47,'',0,'Incidente',NULL,'',772,'',6),(1188,'07-01-2014 - 14:45 - Identificamos em nossa monitoração que o site da BRQ está indisponível. \r\n\r\nEm contato com o analista Ítalo fomos informados que ja estão verificando.\r\n\r\n07-01-2014 - 15:00 - Site disponível após atuação da área de infraestrutura em nuvem. ',23,1,5,5,'2014-01-07 17:01:40','2014-01-09 11:05:32',0,NULL,'','Site BRQ',47,'',1,'Incidente',NULL,'Internal Server Error\r\n\r\nThe server encountered an internal error or misconfiguration and was unable to compl