\r\nEntrada\r\nx \r\n\r\n\r\nLeonardo Wandeck Silva Durães leonardo.wandeck@instant.com.br\r\n15:43 (51 minutos atrás)\r\n\r\npara Adson, Paulo, telefonia, dc, Glauber \r\nAdson, boa tarde.\r\n\r\nSegundo a equipe , o problema foi o Comuter que ficou perdido.\r\n\r\nInformo também que o mesmo sera trocado , pois você terá um analista para a ampliação dos troncos e o Comuter de maior capacidade sera colocado no lugar deste.\r\n\r\n\r\nEm 23 de janeiro de 2014 15:36, Adson Costa <adsoncosta@brq.com> escreveu:\r\nOlá Leonardo, boa tarde!\r\n\r\nHoje 23/01 por volta das 11:45 da manhã nossa operação parou de funcionar, ao verificar as centrais percebi que a DAC02 (redundância) estava alinhada e a DAC01 (principal) estada desalinhada, o curioso é que isso ocorreu sem nenhum tipo de intervenção ou evento que pudesse causar essa mudança. O grande impacto foi que mais uma vez a operação ficou indisponível a partir da DAC02, ou seja, temos uma redundância que praticamente todas as vezes que ela foi acionada não funcionou. Um problema ainda maior que percebemos foi com relação ao Feedback, ao ligar para o suporte da instant a primeira informação passada foi que os canais do E1 estariam bloqueados, e que a operação estaria funcionando na central principal no caso a DAC01 (cenário que definitivamente não estava acontecendo). Para resumir pedi que derrubassem a redundância e voltassem para a principal, assim que isso ocorreu tudo voltou a funcionar normalmente.\r\n\r\nPrecisamos entender definitivamente o que esta acontecendo com o cenário de contingencia  pois ele está nos atendendo, ficamos fora aproximadamente 20 minutos por conta de um problema reincidente que teoricamente já havia sido sanado. Além disso precisamos melhorar identificação principalmente dos problemas que são reincidentes, nossa operação tem níveis de SLA extremamente agressivos que se tornam ainda mais críticos devido ao nosso histórico de indisponibilidades.\r\n\r\nFicamos no aguardo de um feedback oficial sobre o que aconteceu e de uma solução definitiva para os problemas relatados.',74,'',5),(1243,'23-01-2014 - 11:00 - Estamos com uma indisponibilidade no servidor (STA) do Citrix.\r\nTodo o ambiente Citrix está sendo impactado.\r\n\r\n23-01-2014 - 23:43 - O ambiente Citrix foi restaurado e esta no ar.\r\n\r\nTodos os acessos foram testados e estão abrindo normalmente.\r\n\r\n24-01-2014 - 09:15 - Acessos validados e mensagem da URA retirada. \r\n',23,1,5,1,'2014-01-23 19:52:26','2014-01-27 15:29:50',0,NULL,'','Servico de acesso remoto Citrix',33,'',1,'Incidente',NULL,'',78,'',5),(1244,'21/01/2014  13:00:00 - Citrix indisponível \r\n\r\n21/01/2014  17:00:00 - Normalizado após manutenção da área responsável \r\n\r\n',23,1,5,1,'2014-01-24 12:01:33','2014-01-24 13:15:47',0,NULL,'','Servico de acesso remoto Citrix',33,'',0,'Incidente',NULL,'',78,'',5),(1245,'\r\n22/01/2014  12:16:00 - Citrix indisponível\r\n\r\n22/01/2014  21:42:00 - Normalizado após manutenção efetuada pela equipe responsável.\r\n\r\n',23,1,5,1,'2014-01-24 12:03:25','2014-01-24 13:14:34',0,NULL,'','Servico de acesso remoto Citrix',33,'',0,'Incidente',NULL,'',78,'',6),(1246,'teste',1,1,1,6,'2014-01-24 12:25:31','2014-01-24 12:26:27',0,NULL,'','Alerta de teste',47,'',0,'Mudança',NULL,'',NULL,'',1),(1247,'Alerta de Teste v2\r\n\r\nAlerta de Teste v2',1,1,1,6,'2014-01-24 12:27:14','2014-01-24 14:05:56',0,NULL,'','Alerta de Teste v2',47,'',0,'Mudança',NULL,'Alterar CI;',NULL,'',1),(1248,'24/01/2014 - 12:56: Realizando análise nos serviços de Telefonia na localidade Panamérica Park.\r\n\r\n24/01/2014 - 15:36: serviços de telefonia foram restabelecidos, Seguimos em contato junto ao gerente contas, mapeando esta falha para que a mesma seja evitada no futuro.',23,1,5,9,'2014-01-24 14:56:38','2014-01-27 15:31:40',0,NULL,'','Telefonia fixa provida pela GVT',4,'137170201401241329',1,'Incidente',NULL,'24/01/2014 - 12:55: Media Gateway alarmando, realizando contato junto ao analista da localidade para intervenção loca