abelecidas com picotes.\r\nLocalidades testadas, Teofilo - RJ / Boa Vista - SP;\r\n\r\n16/07/2014 10:54h -		\r\nFalha ligações Inter escritórios Boa Vista x Teofilo\r\nBom dia, Prezados\r\nExemplificando, ligações ramal, ramal estão ficando mudas durante 30, 20, 10 segundos em determinados momentos.\r\nPelo que se pode perceber o problema ocorre em todos os ramais independente de onde esteja registrado (10.3.1.201), (10.3.57.100)\r\nSegue o EX a seguir de um ramal de um operador que detecta esse problema frequentemente.\r\nRamal: 0000457\r\n\r\nBruno Barreto - 16/07/2014 14:55:12		\r\nBoa tarde Giuliano,\r\nConforme conversamos a pouco fiquei de analisar as chamadas na plataforma de SP. Nesse período de análises vi que em algumas ligações ocorreram níveis acima do aceitável para conversação VoIP (Lost, Max Delta, Max Jitter).\r\nAbaixo segue o link para download do arquivo com as estatísticas de todas as streams RTP no servidor 10.3.1.201 até o momento:\r\nhttps://www.dropbox.com/s/qiud5r712zxha2g/streams07-16-2014.log\r\nO arquivo do link acima mostram as estatísticas de poucos pacotes trafegados, lembrando que o tráfego RTP é gerenciado pelo IV até um pouco depois de as chamadas serem estabelecidas, após isso elas trafegam ponto-a-ponto, onde não temos mais gerência sobre o tráfego RTP.\r\n\r\n\r\n16/07/2014 - 18:40H: Nelys David dos Santos - Boa Noite Giuliano.\r\nTratando superficialmente os dados do arquivo de stream enviado pela Instant, percebemos que as maiores perdas de pacotes estão em Boa Vista.\r\nPretendemos, na terça-feira dia 22/07/2014, alterar as configurações de IP em Boa Vista para que os MGs e os telefones fiquem na mesma rede da Central Instant.\r\nPara isso, alteraremos a configuração do DHCP para entregar IPs do range 10.3.0.0/21 ao invés de 10.3.64.0/21.\r\nPrecisaremos da ajuda da Instant para alterar os ips dos Media Gateways que estiverem com IPs 10.3.65.XX para 10.3.1.XX.\r\n\r\n17-07-2014 - 11:00 - Instabilidade persiste em toda a BRQ. C